"SWPH01" : "<div class=Section1><h1 class=helpfile>Help </h1><p>The Basic Settings screens allow you to configure, upgrade, and check the status of your NETGEAR Cable/DSL wireless router.</p> <p>Click an item in the leftmost column. The current settings or information for that area appear in the center column. <p>Helpful information related to the selected Settings screen appears in this column. If you are using Internet Explorer, you can click an item in the center column to jump directly to the related help section; otherwise, scroll down until you reach it. <hr><a name=bsetting></a><P><font size=4><B>Basic Settings Help</B></font></P><p><b>Note:</b> If you are setting up the router for the first time, the default settings might work for you with no changes. <a name=question></a><p><b>Does your Internet connection require a login?</b> <p>Select this option based on the type of account you have with your ISP. If you need to enter login information every time you connect to the Internet or you have a PPPoE account with your ISP, select <b>Yes</b>. Otherwise, select <b>No</b>. </p><p><b>Note: </b>If you have installed PPP software such as WinPoET (from Earthlink) or Enternet (from PacBell), then you have PPPoE. Click <b>Yes</b>. After clicking Yes and configuring your router, you will not need to run the PPP software on your PC to connect to the Internet.</p> <a name=isp></a><h2 class=helpfile>Internet Service Provider</h2><p>Select the service provided by your ISP. <b>Other</b> is the most common. <b>PPTP</b> is used in Austria and other European countries. </p><a name=login></a><h2 class=helpfile>Login </h2><p>This is usually the name that you use in your e-mail address. For example, if your main mail account is JerAB@ISP.com, then put JerAB in this field. </p><p>Some ISPs (like Mindspring, Earthlink, and T-DSL) require that you use your full e-mail address when you log in. If your ISP requires your full e-mail address, then type it in the <b>Login</b> field. </p><a name=password></a><h2 class=helpfile>Password</h2><p>Type the password that you use to log in to your ISP. </p><a name=serv_name></a><h2 class=helpfile>Authentication Server</h2><p>Enter the address (either IP address or domain name) of your ISP&apos;s server.</p><a name=idletime></a><h2 class=helpfile>Idle Time-out</h2><p>An idle Internet connection will be terminated after this time period.<p>If this value is zero (0), then the connection will be &apos;kept alive&apos; ,the connection will be reestablished immediately whenever the  connection is lost.</p><a name=DNSaddress></a><h2 class=helpfile>Domain Name Server (DNS) Address </h2><p>The DNS server is used to look up site addresses based on their names. </p><p>If your ISP gave you one or two DNS addresses, select <b>Use These DNS Servers</b>, and type the primary and secondary addresses. </p><p>Otherwise, select <b>Get Automatically from ISP</b>. </p><p><b>Note: </b>If you get &apos;Address not found&apos; errors when you go to a website, it is likely that your DNS servers are not set up correctly. You should contact your ISP to get DNS server addresses. </p><h2 class=helpfile><a name=localaddress></a>Router MAC Address </h2><p>Each computer or router on your network has a unique 48-bit local Ethernet address. This is also referred to as the computer&apos;s MAC (Media Access Control) address. </p><p>Usually, select <b>Use Default Address</b>.</p><p>If your ISP requires MAC authentication, then select either <b>Use Computer MAC Address</b> to have the router use the MAC address of the computer that you are now using, or <b>Use This MAC Address</b>, and manually type in the MAC address that your ISP expects.</p> <p>The format for the MAC address is XX:XX:XX:XX:XX:XX. If you select <b>Use This MAC Address</b> and type in a MAC address, do not select <b>Use This Computer&apos;s MAC Address</b> or your entry will be overwritten.</p><a name=buttons> </a><h2 class=helpfile>Apply, Cancel, and Test Buttons</h2><p>Click <b>Apply</b> when you finish changing the settings. </p><p>Click <b>Cancel</b> to return to the previous settings. </p><p>Click <b>Test</b> to connect to the NETGEAR website. If you connect successfully, your settings work, and you can click <b>Logout</b> to exit these screens and ... enjoy surfing the Net!</p><p>If you do not connect successfully: </p><ul><li>Go through the settings and make sure you have selected the correct options and typed everything correctly. </li><li>Contact your ISP to verify the configuration information. </li><li>Read the Troubleshooting section in the <i> Installation Guide</i> for the device.</li><li>On the <i>Resource CD</i> for the device, read the <i>Setup Manual</i> or the Troubleshooting section in the <i>Reference Guide</i>.</li><li>Contact NETGEAR Technical Support.</li></ul> </div>",
"SWPH02" : "<P><font size=4><B>   Setup Wizard Help  </B></font></P>  <p>The Setup Wizard has detected that an active Internet connection already exist. Since your Internet connection does seem to be working correctly, it might not be necessary for you to continue with the Setup Wizard. If you decide to continue with the Setup Wizard, then some changes to your current setup might occur. NETGEAR recommends that you back up your current settings before proceeding with the Setup Wizard. <p>To proceed:<ol> <li>Click <b>Yes</b> if you want to continue with the Setup Wizard.<br><li>Click <b>No</b> to exit the Setup Wizard and keep your existing Internet connection.</ol> <p>To back up settings:<ol> <li>Click <b>No</b> to exit the Setup Wizard and keep your existing Internet connection.<li>Click <b>Back Up Settings</b> on the navigation bar to enter the Backup screen.<br><li>Once the settings are saved, run the Setup Wizard again.</ol>",
"SWPH03" : "<P><font size=4><B>Smart Setup Wizard Help </B></font></P><p>After connecting the router to your network, you must configure it. You can do this using the Smart Setup Wizard. The wizard will attempt to autodetect the type of Internet service you have through your ISP. Or you can configure the router manually. It is recommended that, if you are not experienced at setting up Internet connections, you let the Smart Setup Wizard do some of the work for you.<p>To configure the router, you will use the information that you filled out earlier in the <I>Installation Guide</i>.<p>To get started:<ol> <li>Select <b>Yes</b> if you want to use the Smart Setup Wizard.<br>or<br>Select <b>No</b> to configure the router manually.<li>Click <b>Next</b>.</ol>",
