"AWCH01" : "<P><font size=4><B>Add WPS Client Help</B></font></P><p><a name=internet></a><a name=meter></a>WPS stands for Wi-Fi Protected Setup. This feature lets you add a wireless client to the network without needing to configure the wireless settings (such as SSID, security mode, and password).<p>You can add a wireless client that supports WPS using the push button method.<p>With the push button method, complete the WPS process by pressing or clicking a WPS push button on the client (either a physical hardware button or a software button on the client's utility UI). See your client's WPS instructions for more information.</p>",
