"UBS018" : "<p>The ReadySHARE Cloud feature gives you remote access over the Internet to a USB storage device that is connected to your router&apos;s USB port.</p><p><b>How to Set Up ReadySHARE Cloud</b></p><p>Step 1: You need a ReadySHARE Cloud account. If you do not have one,<a class=&quot;&quot;linktype&quot;&quot; target=&quot;&quot;_blank&quot;&quot; href=&quot;&quot;https://readyshare.netgear.com/site/index.jsp?pid=4&src=device&quot;&quot;>click here</a> to get one.</p><p>Step 2: On this page, enter your ReadySHARE Cloud user name and password to register your router and the USB device that is connected to it with your account.</p><p>Step 3: Log back into <a class=&quot;&quot;linktype&quot;&quot; target=&quot;&quot;_blank&quot;&quot; href=&quot;&quot;http://readyshare.netgear.com/&quot;&quot;>http://readyshare.netgear.com/</a> with your account. You should see the USB device that is connected to your router.</p><p>Step 4: The first time, you are asked to download a Windows client, which is used to make a secure connection from your PC to the router&apos;s USB device. Log into this client and you can access the USB device from anywhere.</p><p><b>Note:</b> Without this client, you can browse your USB device contents but you cannot open files or make changes to them</p>",
