"UBSH01" : "<P><font size=4><B>ReadySHARE Printer Help</B></font></P><p>ReadySHARE Printer allows Windows PCs and Mac Computers to share with a USB printer attached to the router&apos;s USB port.</p>",
"UBSH02" : "<P><font size=4><B>ReadySHARE Cloud Help</B></font></P><p>The ReadySHARE Cloud feature gives you remote access over the Internet to a USB storage device that is connected to your router&apos;s USB port, no matter where you are. You can also invite family members or friends to access it.</p><p><b>How to Set Up ReadySHARE Cloud</b></p><p>Step 1: You need a ReadySHARE Cloud account. If you do not have one, click the link provided in this page to go to NETGEAR ReadySHARE Cloud page to create an account. <br/>You&apos;ll be asked to enter a valid email address which will be used to recover your user name or password.<br/>Step 2: After Step 1, you need to come back to this router web page, and enter your ReadySHARE Cloud user name and password to register your router and the USB device that is connected to it.<br/>This registration step has to be initiated from your NETGEAR router, meaning you can&apos;t register your router through the NETGEAR ReadySHARE Cloud web site <a target=&apos;_blank&apos; href=&apos;http://readyshare.netgear.com&apos; >http://readyshare.netgear.com</a>.<br/>Step 3: Log back into <a target=&apos;_blank&apos; href=&apos;http://readyshare.netgear.com&apos; >http://readyshare.netgear.com</a> with your account. You should see the USB device that is connected to your router. By default, all the contents of the USB device are accessible. You can create a new share that is limited to any subset of the contents with the security level you specify.<br/>Step 4: The first time you use ReadySHARE Cloud, you are asked to download a Windows client, which is used to make a secure connection from your PC to the router&apos;s USB device. Log into this client and you can access the USB device from anywhere.<br/>Currently you can only download the Windows OS client. The Mac OS client will be ready at a later time on the website.<br/> <b>Note:</b> Without this client, you can only browse your USB device contents by clicking the &apos;+&apos; icon (Add Share) on the website. You won&apos;t be able to open files or make changes to them. </p><p><b>User Name and Password</b></p><p>This is the ReadySHARE Cloud account you created on NETGEAR website in step 1.<br/> The router with USB storage will only show up after you register it. The Internet connection between the router and the ReadySHARE Cloud server will be kept alive until you unregister it.<br/> You can also register the router with another account after unregistering it from previous account.<br/></p>",
"UBSH03" : "<P><font size=4><B> USB Storage (Basic Settings) Help</B></font></P><P><B>NOTE:</B>This page shows your current USB Storage settings, to Edit any of settings shown, or to create a new Network Folder, click Edit </P><P><a name=device></a><B> Network/Device Name </B></P><P> Is the name used to access the Router from your Laptop/PC. The Network/Device Name shown in the Router Web GUI can either be clicked to immediately access the storage or can be entered into a web browser e.g //readyshare.</P><P><a name=available_folder></a><B> Available Network Folders Table</B></P><P> This table shows all the Network Folders currently available and configured on the Router:<UL><LI> Folder Name : Full path of the used by the Network Folder </LI><LI> Volume Name : Volume name from the storage device (either USB drive or HDD)</LI><LI> Total/Free Space : Shows the current utilization of the storage device </LI><LI> Share Name : The Name shown in the Router Web GUI can either be clicked to immediately access the storage or can be entered into a web browser e.g//readyshare/photos.If &apos;Not Shared&apos; is shown then the default share has been deleted and no other share for the root folder exists. Click the link to change this setting.</LI><LI> Read/Write Access : Shows the permissions/access controls on the Network Folder:<ul><li>All - no password allows all users to access the Network Folder </li><li>admin will prompt for users to provide the same username and password used to access the Router Web GUI </li></ul></LI></UL></P><P><B> Edit Button </B></P><P> Click to Edit any of settings shown, or to create a new Network Folder </P><P><B> Safely Remove USB Device Button </B></P><P> Click to Safely Remove either one or all of the USB devices attached to your Router </P><P><B> Refresh Button </B></P><P>Click to Refresh the page, helpful if you have just connected a new USB device</P",
"UBSH04" : "<P><font size=4><B>ReadySHARE Cloud Help</B></font></P><p>The ReadySHARE Cloud feature gives you remote access over the Internet to a USB storage device that is connected to your router&apos;s USB port, no matter where you are. You can also invite family members or friends to access it.</p><p><b>How to Set Up ReadySHARE Cloud</b></p><p>Step 1: You need a ReadySHARE Cloud account. If you do not have one, click the link provided in this page to go to NETGEAR ReadySHARE Cloud page to create an account. <br/>You&apos;ll be asked to enter a valid email address which will be used to recover your user name or password.<br/></p><p>Step 2: After Step 1, you need to come back to this router web page, and enter your ReadySHARE Cloud user name and password to register your router and the USB device that is connected to it.<br/>This registration step has to be initiated from your NETGEAR router, meaning you can&apos;t register your router through the NETGEAR ReadySHARE Cloud web site <a target=&apos;_blank&apos; href=&apos;http://ReadySHARE.netgear.com&apos; >http://ReadySHARE.netgear.com</a>.<br/></p><p>Step 3: Log back into <a target=&apos;_blank&apos; href=&apos;http://ReadySHARE.netgear.com&apos; >http://ReadySHARE.netgear.com</a> with your account. You should see the USB device that is connected to your router. By default, all the contents of the USB device are accessible. You can create a new share that is limited to any subset of the contents with the security level you specify.<br/></p><p>Step 4: The first time you use ReadySHARE Cloud, you are asked to download a Windows client, which is used to make a secure connection from your PC to the router&apos;s USB device. Log into this client and you can access the USB device from anywhere.<br/>Currently you can only download the Windows OS client. The Mac OS client will be ready at a later time on the website.<br/> </p><b>Note:</b> <p>Without this client, you can only browse your USB device contents by clicking the &apos;+&apos; icon (Add Share) on the website. You won&apos;t be able to open files or make changes to them. </p><p><b>User Name and Password</b></p><p>This is the ReadySHARE Cloud account you created on NETGEAR website in step 1.<br/> The router with USB storage will only show up after you register it. The Internet connection between the router and the ReadySHARE Cloud server will be kept alive until you unregister it.<br/> You can also register the router with another account after unregistering it from previous account.<br/></p>",
