"UAS031" : "<p>The ReadyCLOUD feature gives you remote access over the Internet to a USB storage device that is connected to your router&apos;s USB port.</p><p><b>How to Set Up ReadyCLOUD</b><br>Step 1: You need a ReadyCLOUD account. If you do not have one,<a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/index.html#page=manage&quot;>click here to create an account </a> and select &quot;Create Account&quot;.<br>Step 2: Return to this router page and enter your ReadyCLOUD user name and password to register your router and the USB device that is connected to it with ReadyCLOUD.<br>Step 3: Log back into <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/&quot;>http://readycloud-staging.netgear.com/</a> with your ReadyCLOUD account. The USB device that is connected to your router displays.<br><b>Note:</b>You can use a supplementary remote application to make a secure connection from your computer or mobile device to the router&apos;s USB device.<br>Log in to this remote application and you can access the USB device from anywhere. <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/cloud_download.html&quot;>Click here</a> to get the remote application.</p>",
