"UAS041" : "<P><font size=4><B>ReadyCLOUD Help</B></font></P><p>The ReadyCLOUD feature gives you remote access over the Internet to a USB storage device that is connected to your router&apos;s USB port no matter where you are. You can also invite family members or friends to access it.</p><p><b>How to Set Up ReadyCLOUD</b></p><p><ul><li>Step 1: You need a ReadyCLOUD account. If you do not have one, click the link provided in this page to go to the NETGEAR ReadyCLOUD page and create an account. <br>You&apos;ll be asked to enter a valid email address which will be used to recover your user name or password.<br><li>Step 2: After Step 1, you need to come back to this router page, and enter your ReadyCLOUD user name and password to register your router and the USB device that is connected to it.<br>This registration step has to be initiated from your NETGEAR router. You can&apos;t register your router through the NETGEAR ReadyCLOUD web site <a target=&apos;_blank&apos; href=&apos;http://readycloud-staging.netgear.com&apos; >http://readycloud-staging.netgear.com</a><br><li>Step 3: Log back into <a target=&apos;_blank&apos; href=&apos;http://readycloud-staging.netgear.com&apos; >http://readycloud-staging.netgear.com</a> with your ReadyCLOUD account. The USB device that is connected to your router displays. By default, all the contents of the USB device are accessible. You can create a new share that is limited to any subset of the contents with the security level you specify.<br></ul></p><p><b>Note:</b> You can use a supplementary remote application to make a secure connetion from your computer or mobile device to the router&apos;s USB device.<br>Log in to this remote applicaiton and you can access the USB device from anywhere. <a target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/cloud_download.html&quot;>Click here</a> to get the remote application.</p><p><b>User Name and Password</b></p><p>This is the ReadyCLOUD account user name and password you created.<br> The router and USB  device only shows up after you register it. The Internet connection between the router and the ReadyCLOUD server will be kept active until you unregister it.<br> You can also register this router with another account after unregistering it from the previous account.</p>",
