"UAS048" : "<b>Note:</b> Your router keeps a continuous connection to ReadyCLOUD until you unregister.",
"UAS049" : "<p>ReadyCLOUD gives you remote access over the Internet to a USB storage device that is connected to your router&apos;s USB port. To use ReadyCLOUD, you must have a ReadyCLOUD account. If you do not have a ReadyCLOUD account, <a id=&quot;link_rc_info1&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>click here</a>, then click <b>Sign In > Create Account</b>. </p><p><b>To set up ReadyCLOUD</b></p><p><ol><li>Connect a USB storage device to your router&apos;s USB port.</li><li>Enter your ReadyCLOUD user name and password in the fields below and click the <b>Register</b> button. Your router and the USB device are registered with ReadyCLOUD.</li><li> Visit <a id=&quot;link_rc_info2&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>http://readycloud.netgear.com</a>, click Sign In, enter your ReadyCLOUD user name and password, and click the <b>Sign In</b> button.</li></ol></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;You can also use the ReadyCLOUD app to make a secure connection between your computer or mobile device and the router&apos;s USB storage device.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<a id=&quot;link_rc_info3&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com/client/cloud_download.html&quot;>Click here</a> to download the ReadyCLOUD app.</p>",
