"UMS017" : "<P><font size=4><B>Media Server (Settings) Help</B></font></P> <P> You can use your router as a ReadyDLNA media server that serves media in DLNA compatible form to DLNA and UPnP AV compliant media players. Then you can play videos, movies and pictures from compatible media players like the Xbox360, PlayStation, and NETGEAR&apos;s Digital Entertainer Live. </P><P>You can also enable iTunes Media server and play music on your USB storage device using iTunes and Apple Remote.</P><B><P> Enable DNLA Media Server </P></B><P> Select this check box to enable the router to act as a ReadyDLNA media server. </P><B><P> Enable TiVo Support </P></B><P> Select this check box to allow TiVo devices to play media on a USB storage device connected to the router’s USB port.</P><B><P> Enable iTunes Media Server (Music Only) </P></B><P> Select this check box to use iTunes and Apple Remote to play music on a USB storage device connected to the router. When you plug your USB device in to the router’s USB port, you can see the music library that is on the USB device in your iTunes app on your Mac and Windows computers. The iTunes Media Server supports serveral files formats including MP3, AAC, FLAC, WAV, and WMA.</P><B><P> Enter the passcode displayed on Remote App</P></B><P> Apple Remote is an app for iPhone and iPad devices. It can control how music on the USB device is played on airplay devices. When you try to add a new library in the Apple Remote app, a four-digit passcode displays. Enter this passcode in the field and click the “Allow Control” button. Then your Apple Remote app will display the music library on the USB device connected to the router’s USB port. </P><B><P> Media Server/Device Name</P></B><P> This is the media server name that is used for both the DLNA media server and iTunes media server. The media server name is the same as the device name. The default name is the router model number. To change the name, click the “Check Here to change the Device Name” link and type in a new name.</P>",
