"UMSH01" : "<P><font size=4><B>Media Server (Settings) Help</B></font></P> <P>Setting this device as a ReadyDLNA Media server enables playback of Videos Movies and Pictures on DLNA/UPnP AV compliant Media Players like Xbox360, Playstation and NETGEAR&apos;s Digital Entertainer Live.</p><p>ReadyDLNA implies this device serves media in DLNA compatible form to DLNA/UPnP AV compliant Media Players </p> <ul><li><a name=dlna_enable></a><b>Enable Media Server</b> enables this device to act as a Media server.</li><li><a name=tivo_enable></a><b>Enable TiVo® support</b> Please visit http://kb.netgear.com/app/answers/detail/a_id/24316 to see how to use this feature with your TiVo device.</li><li><a name=dev_name></a><b>Media Server name</b> is the name that shows up on Media Players</li></ul> </p><p><b>Content Scan</b><ul><li><b>Automatically update database </b> Scans for Media files whenever new files are added to the ReadyShare USB Storage. Only shared folder with “All – no password” in Read Access can be scanned for Media files.</li><li>You can also click <b>Rescan media files</b> to delete current database and do a whole new scan immediately.</li></ul></p>",
