"CLOH01" : "<P><font size=4><B>Logs Help</B></font></P><p>A log is a detailed record of the websites that users on your network have accessed or attempted to access. If you have set up content filtering on the Block Sites screen, the Logs screen shows you when someone on your network tried to access a blocked site. If you have e-mail notification on, you will receive these logs in an e-mail message. If you do not have e-mail notification set up, you can view the logs here.</p><p><ul><li>Click <b>Clear Log</b> to delete all the log entries.</ul><p><ul><li>Click <b>Refresh</b> to see the most recent access attempts.</ul><p><ul><li>Click <b>Send Log</b> to send the log file to your e-mail account. This feature can be very useful for testing your e-mail settings.</ul>",
