"CBSH01" : "<P><font size=4><B>Block Sites Help</B></font></P> <p>If you want to limit access to certain sites on the Internet, you need to set up content filtering. There are two ways to filter content: <ul><li>Blocking access to certain domains (for example, www.badstuff.com/XXX) <li>Blocking sites that contain certain words (like profanity or explicit sexual material). </UL><p>When users try to access a blocked site, they will get a message: Blocked by NETGEAR.</p><hr><a name=blocking></a><p><b>To enable site blocking:</b></p><ul>Select <b>Per Schedule</b> to turn on site blocking and block according to the settings on the Schedule screen.</ul><ul>Select <b>Always</b> to turn on site blocking to allow blocking all the time, independent of the settings on the Schedule screen.</ul><p><b>Note:</b> On the Schedule screen you can set when keyword and domain name blocking occurs.</p><p><b>To disable site blocking:</b></p><p><ul>Select <b>Never</b> to turn off site blocking.</ul><hr><a name=toaddword></a><p><b>To Block Keywords or Internet Domains:</b></p><ol><li>Select when to turn on Keyword Blocking (Never, Per Schedule, or Always).</li><li>In the <a name=toaddword></a> <b>Type Keyword Or Domain Name Here</b> field, type the word or domain name you want to block.</li><li>Click <b>Add Keyword</b>.<li>The word or domain name will appear in the list.</li><li>Continue adding names and keywords until you are finished.</li><li>Click <b>Apply</b> when finished.</li></ol><a name=blocklist></a><p><b>Block List</b>. The list under the heading Block Sites Containing these Keywords or Domain Names contains the current list of items to block.</p><a name=todelete></a><p><b>To delete a keyword or domain name:</b></p><ol><li>Select the word or domain name in the list.</li><li>Click <b>Delete Keyword</b>.</li><li>Continue selecting and deleting names and keywords until you are finished.</li><li>Click <b>Apply</b>.</li></ol><p><b>To delete all keywords and domain names:</b></p><ol><li>Click <b>Clear List</b>.</li><li>Click <b>Apply</b>.</li></ol></p><hr><a name=trusted></a><p><b>To allow one computer to have unrestricted access to the Internet:</b></p><ol><li>Select the <b>Allow Trusted IP Address to Visit Blocked Sites</b> check box.</li><li>Type the IP address of the computer in the Trusted IP Address area. <br>You should need to type a number only in the last field.</li><li>Click <b>Apply</b>.</li></ol><a name=To></a><p><b>To allow unrestricted access to the Internet:</b></p><ol><li>Select <B>Never</b> in the <b>Keyword Blocking</b> list.</li><li>Click <b>Apply</b>.</li></ol>",
