"CSEH01" : "<P><font size=4><B>Schedule Help</B></font></P><p>If you have set up content filtering on the Block Sites screen or service blocking on the Block Services screen, you can set up a schedule for when blocking occurs or when access is not restricted. </p><a name=blocksch></a><p>To block keywords, services, or Internet domains based on a schedule:<ol><li>Select one of the following:<b>Every Day</b>.<br>One or more days.</li><li>If you want to limit access completely for the selected days, select <b>All Day</b>.<br>If you want to limit access during certain times for the selected days, enter a time in the <b>Start Blocking</b> and <b>End Blocking</b> fields.<br><b>Note:</b> Enter the values as 24-hour time. For example, 10:30 a.m. would be 10 hours and 30 minutes, and 10:30 p.m. would be 22 hours and 30 minutes.</li><li>Click <a name=Apply></a><b>Apply</b>.</li></ol>",
"CSEH02" : "<P><font size=4><B>Schedule Help</B></font></P><p>If you have set up content filtering on the Block Sites screen or service blocking on the Block Services screen, you can set up a schedule for when blocking occurs or when access is not restricted. </p><p name=blocksch id=blocksch></p><p>To block keywords, services, or Internet domains based on a schedule:<ol><li>Select one of the following:<b>Every Day</b>.<br>One or more days.</li><li>If you want to limit access completely for the selected days, select <b>All Day</b>.<br>If you want to limit access during certain times for the selected days, enter a time in the <b>Start Blocking</b> and <b>End Blocking</b> fields.<br><b>Note:</b> Enter the values as 24-hour time. For example, 10:30 a.m. would be 10 hours and 30 minutes, and 10:30 p.m. would be 22 hours and 30 minutes.</li><li>Click <p name=Apply id=Apply><b>Apply</b>.</p></li></ol>",
