"MADH01" : "<P><font size=4><B>Attached Devices Help</B></font></P><p>This screen shows the IP address, device name, and MAC (Media Access Control) address for each computer attached to the router.<p>You cannot change any of the values on this screen. To update this screen and show the list of currently attached devices, click the <i>Refresh</i> button.",
"MADH02" : "<P><font size=4><B>Attached Devices Help</B></font></P><p>This screen shows the IP address, device name, and MAC (Media Access Control) address for each computer attached to the router.<p>You cannot change any of the values on this screen. To update this screen and show the list of currently attached devices, click the <b id=italic>Refresh</b> button. <p>To block or allow one or more devices to access your network, click the Access Control link in the top right corner of this screen to go to the Access Control screen and make changes.",
"MADH03" : "<p><font size=4><b>Attached Device Help</b></font></p><p>This screen displays information about the devices that are attached to the router. </p><p><b>Edit selection:</b> Select a device and click the<b>Edit</b>button. The Edit Device page displays. </p><p><b>Status:</b>This column shows a device&apos;s access control status. If access control is disabled, this column is hidden.</p><p><b>Priority:</b> This column is available when Quality of Service is turned on. Four priority levels are available: highest, high, medium, and low. Gaming consoles and streaming devices are assigned high priority by default. Other devices are assigned medium priority by default. Click the <b>Edit</b>button to change a device&apos;s priority level. </p><p><b>Connection Type:</b> This column shows how a device connects to router. </p><p><b>Device Name:</b>This column shows a device&apos;s name, type icon, and IP address. This information is automatically detected by the router. If Quality of Service is enabled, the router automatically detects the device type. If Quality of Service is disabled, the default device type shows as other. Click the <b>Edit</b> button to manually assign a device name or device type. If Quality of Service is enabled, the IP address displays in this column. Mouse over the device name to display the MAC address, device type, and SSID information (for wireless devices only). If Quality of Service is enabled, click the device name to display detailed Internet bandwidth usage information. </p><p><b>IP Address:</b>This column shows the IP address of this device. This column exists only if Quality of Service is disabled. </p><p><b>MAC Address:</b> This column shows MAC address of this device. This column exists only if Quality of Service is disabled. </p><p><b>Internet Download Speed by Device:</b> This column shows the concurrent Internet download speed usage for this device. </p><p><b>Internet Upload Speed by Device:</b> This column shows the concurrent Internet upload speed usage for this device. </p><p>To block or allow one or more devices to access your network, click the <b>Access Control</b> link in the top right corner of this screen to go to the Access Control screen and make changes.</p>",
"MADH04" : "<p><font size=4><b>Edit Device Help</b></font></p><a name=ip_tag></a><p><b>IP Address:</b> Shows the device IP address. This field is not editable. </p><a name=mac_tag></a><p><b>MAC Address:</b> Shows the device MAC address. This field is not editable. </p><a name=name_tag></a><p><b>Device Name:</b> You can enter your preferred device name. Clear the device name to let the router detect it automatically. </p><a name=priority_tag></a><p><b>Device Priority:</b>  This column is available when Dynamic QoS is turned on. Four device priority levels are available: highest, high, medium, and low. Device priority is assigned according to auto-detected device types. QoS first prioritize traffic by using application category. When running high priority applications in the same category on different devices, device priority is then used to prioritize the traffic.<br> For example, if you have a Smart TV and a mobile device both streaming NETFLIX at the same time, the Smart TV will get higher priority since the Smart TV is considered a higher priority device type.</p>",
"MADH05" : "<p><font size=4><b>Device Bandwidth Usage Page Help</b></font></p><p>This page shows detailed application bandwidth usage. It shows application bandwidth usage that the router is able to detect. Application bandwidth usage that the router cannot detect is included in the general application. </p><p><b>Application:</b> The application traffic type detected by the router. </p><p><b>Internet download speed by App:</b> The current Internet download speed used by each application. </p><p><b>Internet upload speed by App:</b> The current Internet upload speed used by each application. </p><p><b>Refresh Button:</b> Click the <b>Refresh</b> button to update the application list and bandwidth usage.</p><p><b>Back button:</b> Click the <b>Back</b> button to display the previous screen. </p>",
"MADH06" : "<p><font size=4><b>Attached Device Help</b></font></p><p>This screen displays information about the devices that are attached to the router. </p><p><b>Edit selection:</b> Select a device and click the<b>Edit</b>button. The Edit Device page displays. </p><p><b>Status:</b>This column shows a device&apos;s access control status. If access control is disabled, this column is hidden.</p><p><b>Device Priority:</b> This column is available when Dynamic QoS is turned on. Four device priority levels are available: highest, high, medium, and low. Device priority is assigned according to auto-detected device types. QoS first prioritize traffic by using application category. When running high priority applications in the same category on different devices, device priority is then used to prioritize the traffic. </p><p>For example, if you have a Smart TV and a mobile device both streaming NETFLIX at the same time, the Smart TV will get higher priority since the Smart TV is considered a higher priority device type.</p><p><b>Connection Type:</b> This column shows how a device connects to router. </p><p><b>Device Name:</b>This column shows a device&apos;s name, type icon, and IP address. This information is automatically detected by the router. If Dynamic QoS is enabled, the router automatically detects the device type. If Dynamic QoS is disabled, the default device type shows as other. Click the <b>Edit</b> button to manually assign a device name or device type. If Dynamic QoS is enabled, the IP address displays in this column. Mouse over the device name to display the MAC address, device type, and SSID information (for wireless devices only). If Dynamic QoS is enabled, click the device name to display detailed Internet bandwidth usage information. </p><p><b>IP Address:</b>This column shows the IP address of this device. This column exists only if Dynamic QoS is disabled. </p><p><b>MAC Address:</b> This column shows MAC address of this device. This column exists only if Dynamic QoS is disabled. </p><p><b>Internet Download Speed by Device:</b> This column shows the concurrent Internet download speed usage for this device. </p><p><b>Internet Upload Speed by Device:</b> This column shows the concurrent Internet upload speed usage for this device. </p><p>To block or allow one or more devices to access your network, click the <b>Access Control</b> link in the top right corner of this screen to go to the Access Control screen and make changes.</p>",
