"MRUH01" : "<h1>Check Language Help</h1><p>The GUI language is different from the browser language, if you want to switch the GUI language to the browser language, please click the <b>Yes</b> button, else click the <b>No</b> button</p>",
"MRUH02" : "<P><font size=4><B>Firmware Upgrade Assistant Help</B></font></P><p>The router can automatically detect whether a new version of the firmware is available on the Internet.<p>Click <b>Yes</b> if you want to start the detection now.<br>Click <b>No</b> if you want do not want to check for a new version now.<p>If you prefer to check for a new version later, you can do this on the Router Upgrade screen.<p>If you do not want to see this message again the next time you log in, select the <b>Do not display this message again</b> check box, and click <b>No</b>.",
"MRUH03" : "<P><font size=4><B> GUI Language Update Help </B></font></P> <p>You have selected the GUI language from the <b>Select Language</b> list. You can use the GUI Language Update function to check the GUI language update. This function will check only the GUI language update itself, not the full firmware.<p>Click the <b>Check</b> button to go to the NETGEAR website to get new version of the selected GUI language. <p>If a new version is found, you can select <b>Yes</b> to update to that new version, or <b>No</b> to cancel the update.",
"MRUH04" : "<p><font size=4><b>Router Upgrade Help</b></font></p> <p>You install new versions of the router&apos;s software using the Router Upgrade screen. <a name=check></a> <p>Click the <b>Check</b> button to go to the NETGEAR website to get <b>new versions</b> of the router software. After downloading the file, you will need to unzip (or unstuff) it before upgrading the router.    <p>Select the check box if you want to check for a new version upon login. <p><b>IMPORTANT!</b> Once you click <b>Upload</b>, do <i>not</i> interrupt the process of sending the software to the router and restarting the router. If you think the process might be interrupted in some way, click <b>Cancel</b> to keep the current router software.</p><a name=locate></a><p><b>Locate and select the upgrade file on your hard disk.</b><ol><li>Go to www.NETGEAR.com and download the updated software.<li>If it is not done automatically, uncompress the file.<br>You might want to read the <i>Release Notes</i> before continuing.<li>Click <b>Browse</b>.<li>Locate and select the file you just downloaded and uncompressed.<li>Click <b>Upload</b> to send the software to the router.<br>This loads the new software in the router and causes the router to restart.<br><b>Note:</b> Do not try to go online, turn off the router, shut down the computer, or do anything else to the router until the router finishes restarting! When the Ready light stops blinking, wait a few more seconds before doing anything.<li>Click <b>Router Status</b> and check the firmware version to verify that your router now has the new software installed. </ol><p><B>IMPORTANT!</b> In some cases, such as a major upgrades, you might need to reconfigure your router after upgrading it. Refer to the <i>Release Notes</i> included with the software to find out if you need to reconfigure the router. <p>If you are unable to successfully upgrade using this method, refer to the <i>Reference Manual</i> from the product&apos;s support web site for other ways to upgrade the router.</p>",
