"AAW050" : "<p><font size=4><B>Wireless Bridge Help</B></font></p><HR><p>You can use your router in bridge mode to connect multiple devices wirelessly at the faster 802.11ac speed.<br>Enable Bridge Mode: you can enable or disable bridge mode.<br>Click the Setup Bridge Mode Wireless Settings button to specify the settings of the other router to which this router will connect.<br>1. You can select the wireless network frequency (2.4 GHz or 5 GHz). For 802.11ac mode, select 5 GHz.<br>2. In the Name (SSID) field, enter the wireless network name (SSID).<br>3. In the Security Option section, select a radio button.<br>4. If prompted, type the passphrase (the WiFi password that you use to connect wirelessly to the other router).<br>5. Click the Apply button.<br>You also have to choose IP Address settings on this bridge, either \&quot;Get dynamically from existing router\&quot; or \&quot;Use fixed IP Address (not recommanded)\&quot;.<br>Click the Apply button on the Wireless Bridge page then your changes take effect.</p>",
