"ANMH01" : "<p><font size=4><b> Network Monitor Display Settings Help </b></font></p><p>Network Monitor Display allows you to customize the behavior of LED on the blue dome.  To turn on or off the LED, you can either press down on the blue dome, or use the settings below.  For LED blinking patterns, please refer to the help section on the right.  The LED settings are only applicable when the LED is switched on.</p><a name=display></a><p><b>Wireless data status (default)</b></p><p>LEDs blink when wireless data is transmitted. Left LED indicates incoming data and right LED indicates outgoing data.</p><p><b>Guest Network status</b></p><p>LEDs are turned on when Guest Network is enabled and blink when a computer is connected to it.</p><p><b>Live Parental Controls status</b></p><p>LEDs are turned on when Live Parental Controls is enabled and blink when an attempted access is blocked.</p><p><b>Broadband Usage Meter status</b></p><p>LEDs blink when usage reaches the warning level and remain on when the usage reaches the pre-set limit.</p><p><b>To Save Or Cancel Changes</b><ul><li>Click <b>Apply</b> to save the new settings to the router.</li><li>Click <b>Cancel</b> to discard any unsaved changes.</li></p>",
