"AWN048" : "<p name=vpn_passthrough id=vpn_passthrough><b>VPN Passthrough</b></p><p>This option allows user to enable/disable VPN passthrough function. By default, router support three kinds of VPN passthrough service: IPSec, PPTP, and L2TP.</p>",
