"AWNH01" : "<P><font size=4><B>WAN Setup Help </B></font></P><p>Using this page, you can set up a Default DMZ Server and allow the router to respond to a &apos;ping&apos; from the internet. Both of these options have security issues, so use them carefully.</p><a name=spi></a><p><b>Disable Port Scan and DoS Protection</b> - The DoS Protection protects your LAN against Denial of Service attacks. This should only be disabled in special circumstances.</p><a name=dmz></a><p><b> Default DMZ Server </b><p>Specifying a Default DMZ Server allows you to set up a computer or server that is available to anyone on the Internet for services that you haven&apos;t defined. There are security issues with doing this, so only do this if you&apos;re willing to risk open access. If you do not assign a Default DMZ Server, the router discards any incoming service requests which are undefined.<p> To assign a computer or server to be a DMZ server: <ol><li>Click the <i>Default DMZ Server</i> check box</li>.<li>Type the IP address for that server. </li><li>Click <b> Apply</b>. </li></ol><hr><a name=ping></a><p><b> Respond To Ping On Internet Port </b><p>If you want the Router to respond to a &apos;Ping&apos; from the Internet, click this check box. This can be used as a diagnostic tool. Again, like the DMZ server, this can be a security problem. You shouldn&apos;t check this box unless you have a specific reason to do so. </p><a name=mtu></a><p><b>MTU Size</b><p>The normal MTU (Maximum Transmit Unit) value for most Ethernet networks is 1500 Bytes, 1492 Bytes for PPPoE connections, 1436 for PPTP, or 1428 for L2TP connections. For some ISPs you may need to reduce the MTU. But this is rarely required, and should not be done unless you are sure it is necessary for your ISP connection.</p><a name=nat></a><p><b>NAT Filtering</b><p>This option determines how the router deals with inbound traffic. The Secured option provides a secured firewall to protect the PCs on LAN from attacks from the Internet, but it may cause some Internet games, point-to-point applications, or multimedia applications not to work. The Open option, on the other hand, provides a much less secured firewall, while it allows almost all Internet applications to work.</p><p><b>Disable SIP ALG</b><p>Some voice/video communication applications do not work well with the SIP ALG. Enabling this option to turn off the SIP ALG may help your voice/video applications to create/accept a call through the router.</p>",
"AWNH02" : "<P><font size=4><B>WAN Setup Help </B></font></P><p>Using this page, you can set up a Default DMZ Server and allow the router to respond to a &apos;ping&apos; from the internet. Both of these options have security issues, so use them carefully.</p><a name=spi></a><p><b>Disable Port Scan and DoS Protection</b> - The DoS Protection protects your LAN against Denial of Service attacks. This should only be disabled in special circumstances.</p><a name=dmz></a><p><b> Default DMZ Server </b><p>Specifying a Default DMZ Server allows you to set up a computer or server that is available to anyone on the Internet for services that you haven&apos;t defined. There are security issues with doing this, so only do this if you&apos;re willing to risk open access. If you do not assign a Default DMZ Server, the router discards any incoming service requests which are undefined.<p> To assign a computer or server to be a DMZ server: <ol><li>Click the <i>Default DMZ Server</i> check box</li>.<li>Type the IP address for that server. </li><li>Click <b> Apply</b>. </li></ol><hr><a name=ping></a><p><b> Respond To Ping On Internet Port </b><p>If you want the Router to respond to a &apos;Ping&apos; from the Internet, click this check box. This can be used as a diagnostic tool. Again, like the DMZ server, this can be a security problem. You shouldn&apos;t check this box unless you have a specific reason to do so. </p><a name=igmp></a><p><b>Disable IGMP Proxying</b></p><p>The IGMP Proxying function lets a LAN PC to receive the multicast traffic it is interested in from the Internet. You can click this check box to disable the function if you do not need it.</p><a name=mtu></a><p><b>MTU Size</b><p>The normal MTU (Maximum Transmit Unit) value for most Ethernet networks is 1500 Bytes, 1492 Bytes for PPPoE connections, 1436 for PPTP, or 1428 for L2TP connections. For some ISPs you may need to reduce the MTU. But this is rarely required, and should not be done unless you are sure it is necessary for your ISP connection.</p><a name=nat></a><p><b>NAT Filtering</b><p>This option determines how the router deals with inbound traffic. The Secured option provides a secured firewall to protect the PCs on LAN from attacks from the Internet, but it may cause some Internet games, point-to-point applications, or multimedia applications not to work. The Open option, on the other hand, provides a much less secured firewall, while it allows almost all Internet applications to work.</p><p><b>Disable SIP ALG</b><p>Some voice/video communication applications do not work well with the SIP ALG. Enabling this option to turn off the SIP ALG may help your voice/video applications to create/accept a call through the router.</p>",
"AWNH03" : "<p><A name=iptv></A><p><b>IPTV Setup</b><p>Some IPTVs cannot work behind a router&apos;s network address translation (NAT) firewall. They need to use an IP address within the ISP&apos;s network (intranet address). The IPTV port solution supports this requirement by creating a bridge connection from the WAN to IPTV device.<p>",
"AWNH04" : "<p><b>Enable IPv6 Pass-Through</b><p>IPv6 pass-through is disable by default. If you have IPv6 capable devices in your configuration and would like to use IPv6 instead IPv4, you can click on check box to enable \&quot;IPv6 Pass-Through\&quot;. </p>",
"AWNH05" : "<P><font size=4><B>Wireless WAN Help</B></font></P><p>You can get Internet by WiFi connection. Some WISP (Wireless Internet Service Provider) may charge when you&apos;re using the service. Please contact your service provider for details.</p><b>I am in a public network</b><ol>Enable the option if you are in a public place, such as coffee shop, airport, rail station, or hotel. Disable the option if you are at home.</ol><b>Reachable Wireless List</b><ol>All the detected wireless access points by sequence of signal strength. Please select a desired one.</ol><b>Security Configuration</b><ol>Please enter in wireless pass-phrase if required.</ol><b>Save as profile</b><ol>Save the current settings for quick reference in the future. Uncheck the option if you don&apos;t want to keep the settings.</ol>",
