"ADDH01" : "<P><font size=4><B>Dynamic DNS Help</B></font></P><p> A Dynamic DNS (DDNS) service provides a central public database where information (such as e-mail addresses, host names, and IP addresses) can be stored and retrieved. The Dynamic DNS server also stores password-protected information and accepts queries based on e-mail addresses. </p><p> If you want to use a DDNS service, you must register for it. The Dynamic DNS client service provider will give you a password or key.</p><a name=setup></a><p>To set up for DDNS:<ol><li>If you have registered with a DDNS service provider, select the <b>Use A Dynamic DNS Service</b> check box.  </li><li><a name=provider></a>Select the name of your Dynamic DNS service provider.&nbsp; </li><li>Type the host name that your Dynamic DNS service provider gave you. <br>The DDNS service provider might call this the domain name. </li><li>Type the user name for your DDNS account. </li><li>Type the password (or key) for your DDNS account. </li> <li>Click <b>Apply</b> to have the DDNS service used.  </li></ol><p><b>Note:</b> The router supports only basic DDNS, and the login and password might not be secure. If you have a private WAN IP address, do not use DDNS service as it can lead to problems. </p>",
"ADDH02" : "<P><font size=4><B>Dynamic DNS Help</B></font></P><p> A Dynamic DNS (DDNS) service provides a central public database where information (such as e-mail addresses, host names, and IP addresses) can be stored and retrieved. The Dynamic DNS server also stores password-protected information and accepts queries based on e-mail addresses. </p><p> If you want to use a DDNS service, you must register for it. The Dynamic DNS client service provider will give you a password or key.</p><a name=setup></a><p>To set up for DDNS:<ol><li> Select the <b>Use A Dynamic DNS Service</b> check box to enable the Dynamic DNS function.  </li><li>If you have not registered with a DDNS service provider, select <b>NETGEAR</b> from the <b>Service Provider</b> list. Otherwise select the name of your Dynamic DNS service provider from the list. </li><li>Type the host name that you have registered with your Dynamic DNS service provider. <br>The DDNS service provider might call this the domain name. </li><li>Type the user name for your DDNS account. </li><li>Type the password (or key) for your DDNS account. </li> <li>Click <b>Apply</b> to have the DDNS service used.  </li></ol><p><b>Note:</b> The router supports only basic DDNS, and the login and password might not be secure. If you have a private WAN IP address, do not use DDNS service as it can lead to problems. </p>",
"ADDH03" : "<P><font size=4><B>Dynamic DNS Help</B></font></P><p> A Dynamic DNS (DDNS) service provides a central public database where information (such as e-mail addresses, host names, and IP addresses) can be stored and retrieved. The Dynamic DNS server also stores password-protected information and accepts queries based on e-mail addresses. </p><p> If you want to use a DDNS service, you must register for it. The Dynamic DNS client service provider will give you a password or key.</p><a name=setup></a><p>To set up for DDNS:<ol><li>Select the <b>Use A Dynamic DNS Service</b> check box to enable the Dynamic DNS function.  </li><li>If you have not registered with a DDNS service provider, select <b>NETGEAR</b> from the <b>Service Provider</b> list.  Otherwise select the name of your Dynamic DNS service provider from the list.</li><li>If this is your first time to use the NETGEAR DDNS service, please select <b>No</b> for the question <b>Do you have a NETGEAR DDNS account?</b>. Otherwise you can select <b>Yes</b> and then enter your account information.</li><li>Type the host name that you wish to use this device. This is sometimes called as a domain name. </li><li>Type the email address you want to use for your DDNS account. </li><li>Type the password (or key) for your DDNS account. </li> <li>Click <b>Register</b> to register for the NETGEAR DDNS service.  </li></ol><p><b>Note:</b> The router supports only basic DDNS, and the login and password might not be secure. If you have a private WAN IP address, do not use DDNS service as it can lead to problems. </p>",
"ADDH04" : "<P><font size=4><B>Dynamic DNS Help</B></font></P><p> A Dynamic DNS (DDNS) service provides a central public database where information (such as e-mail addresses, host names, and IP addresses) can be stored and retrieved. The Dynamic DNS server also stores password-protected information and accepts queries based on e-mail addresses. </p><p> If you want to use a DDNS service, you must register for it. The Dynamic DNS client service provider will give you a password or key.</p><a name=setup></a><p>To set up for DDNS:<ol><li> Select the <b>Use A Dynamic DNS Service</b> check box to enable the Dynamic DNS function.  </li><li>If you have not registered with a DDNS service provider, select <b>NETGEAR</b> from the <b>Service Provider</b> list. Otherwise select the name of your Dynamic DNS service provider from the list. </li><li>If this is your first time to use the NETGEAR DDNS service, you can select <b>No</b> for the question <b>Do you have a NETGEAR DDNS account?</b>. Otherwise you can select <b>Yes</b> and then enter your account information.</li><li>Type the host name that you have registered for your NETGEAR DDNS service. This is sometimes called as a domain name. </li><li>Type the email address used for your DDNS account. </li><li>Type the password (or key) for your DDNS account. </li> <li>Click <b>Apply</b> to have the DDNS service used.  </li></ol><p><b>Note:</b> The router supports only basic DDNS, and the login and password might not be secure. If you have a private WAN IP address, do not use DDNS service as it can lead to problems. </p>",
