"ASRH01" : "<P><font size=4><B>Static Routes Help</B></font></P><p> Static routes give the router information that it cannot learn automatically through other means. This can happen when RIP is disabled on the LAN. (See the LAN IP Setup screen.) All defined static routes appear in the table. You add or delete a route in the area under the Static Routes table.</p><hr><a name=str_table></a><p><b>To set up a static route:</b> </p><ol><li>Click the <b>Add</b> button. </li><li>Type a route name for this static route in the <b>Route Name</b> field under the table.<br>(This is for identification purposes only.) </li><li>Select <b>Private</b> if you want to limit access to the LAN only. </li><li>Select <b>Active</b> to make this route effective. </li><li>Type the destination IP address of the final destination. </li><li>Type the IP subnet mask for this destination. <br>If this is for a single host, type <b>255.255.255.255</b>. </li><li>  Type the gateway IP address, which must be a router on the same segment. </li><li>Type a number between 2 and 15 as the <b>Metric</b> value.   <br>This represents the number of other routers on your network. Usually, setting this to 2 or 3 works best, but if this is a direct connection, set it to 2. </li><li>  Click <b>Apply</b> to enter the static route into the table. </li></ol><p><b>To edit a static route:</b> <ol><li>Click the radio button next to route you want to edit. </li><li> Update the information.<li>Click <b>Apply</b> when finished.</ol><p><b>To delete a static route:</b> <ol><li>Click the radio button next to route you want to delete. </li><li>Click <b>Delete</b>.</li><li>Click <b>Apply</b> to delete the static route from the table. </li></ol>",
