"AUPH01" : "<p><font size=4><b>    UPnP Help  </b></font></p><p>Universal Plug and Play (UPnP) helps devices, such as Internet appliances and computers, access the network and connect to other devices as needed. UPnP devices can automatically discover the services from other registered UPnP devices on the network. </p><a name=turnon></a> <p><b>Turn UPnP On</b></p><p>UPnP can be enabled for automatic device configuration, or it can be disabled. The default setting for UPnP is enabled. If this feature is disabled, the router will not allow any device to automatically control the resources, such as port forwarding (mapping), of the router. </p><a name=adv></a>  <p><b>Advertisement Period</b></p><p>The advertisement period is how often the router advertises (broadcasts) its UPnP information. This value can range from 1 to 1440 minutes. The default period is 30 minutes. Shorter durations ensure that control points have current device status at the expense of additional network traffic. Longer durations might compromise the freshness of the device status but can significantly reduce network traffic.</p><a name=live></a>  <p><b>Advertisement Time to Live</b></p><p>The time to live for the advertisement is measured in hops (steps) for each UPnP packet sent. A hop is the number of steps allowed to propagate for each UPnP advertisement before it disappears. The number of hops can range from 1 to 255. The default value for the advertisement time to live is 4 hops, which should be fine for most home networks. If you notice that some devices are not being updated or reached correctly, then it might be necessary to increase this value a little.</p><a name=table></a><p><b>UPnP Portmap Table</b></p><p>The UPnP Portmap table displays the IP address of each UPnP device that is currently accessing the router and which ports (internal and external) that device has opened. The UPnP Portmap table also displays what type of port is opened and if that port is still active for each IP address.<p><b>To save, cancel or refresh the table:</b></p><p>Click <b>Apply</b> to save the new settings to the router. <br>Click <b>Cancel</b> to discard any unsaved changes. <br>Click <b>Refresh</b> to update the Portmap table and show the active ports that are currently opened by UPnP devices.",
