"ATMH01" : "<P><font size=4><B> Traffic Meter Help </B></font></P><A name=internet></A><H2 class=helpfile> <b>Internet Traffic Meter </b></H2><A name=meter></A><P><B> Enable Traffic Meter </B> <BR> Check this if you wish to record the volume of Internet traffic passing through the Router&apos;s Internet port. <P><B> Traffic volume control by </B> <BR> Select this if you wish to record and restrict the volume of Internet traffic passing through the Router&apos;s Internet port.<UL><LI> No Limit - If this is selected specified restriction will not be applied when traffic limit is reached.<LI> Download only - If this is selected the specified restriction will be applied to the incoming traffic only <LI> Both Directions - If this is selected the specified restriction will be applied to both incoming and outgoing traffic only.</UL><P><B> Connection time control</B> <BR> Select this if you wish to record and restrict the time usage of the Internet connection.<P><B> Monthly Limit </B><BR> Enter the monthly volume limit or connection time limit.<P><B> Round up data volume for each connection by</B> <BR> Some ISPs charge certain amount of extra data volume when users make a new connection. If this case, enter the extra data volume here.<A name=counter></A><H2 class=helpfile> <b>Traffic counter</b></H2><P><B> Restart traffic counter</B><BR> This determines when the traffic counter restarts. Choose the desired time and day of the month.<P><B> Restart Counter Now</B> <BR> Click this button to restart the Traffic Counter immediately.<A name=reached></A><H2 class=helpfile> <b> Traffic Control </b></H2><P><B> Pop up a warning message</B><BR> Entering a non-zero value to make the router pop-up a warning message when the monthly data volume/connection time limit will be reached after the configured amount is run out. Only when the Traffic Status window is opened, the pop-up message can show up.<P><B> When the monthly limit is reached</B><BR><P> Check the desired action(s):<UL> <LI> Turn the Internet LED green/amber flashing - the Internet LED will become green and amber alternatively. <LI> Disconnect and disable the Internet connection - all access to the Internet will be blocked. </UL><A name=statistics></A><H2 class=helpfile><b> Internet Traffic Statistics</b></H2><P> This displays statistics on Internet traffic via the Internet port. <BR> If you have not enabled the Traffic Meter, these statistics are not available. <P><B> Traffic Status</B> <BR><BR> Click this button if you want live update about the usage status of the Internet traffic.<P></P>",
