"GD99" : "NETGEAR Downloader is a new BETA feature released on a few selected routers.  It helps you take advantage of the bandwidth when your computer is turned off or away from home, saves time and electricity bill.  For example, you can get the router start downloading a multimedia file in the morning, take your laptop to work, and when you return home in the evening, the file would be downloaded in the USB drive ready for your enjoyment.",
"GD100" : "In an effort to continuously improve the usability and functionality of this feature, we would like your participation to help us do that by emailing us your suggestions, issues, and questions to xyz@netgear.com, and someone from NETGEAR will get back to you shortly via email. We ask that you do not contact NETGEAR support or discuss in public forums about this feature.  Emailing us is the best way to get a response.  Thank you for your help!",
