"GDH01" : "<p><font size=4><B>NETGEAR Downloader</B></font></p><p><b>NETGEAR Downloader</b> supports HTTP, FTP, BT and eDonkey download protocols. With NETGEAR Downloader, you can use a <b>NETGEAR Router</b> to download Internet files and save them to a USB storage device without keeping a computer turned on.</p><hr><a name=green_path></a><b>Save As Path: </b>Choose a location where you want to save downloaded files.</p>",
"GDH02" : "<p><b>FTP/HTTP Download</b> allows user to download files from Internet through FTP/HTTP protocol.</p><hr><p><a name=http_url></a><b>FTP/HTTP Download Link: </b>This is an Internet address and indicates the URL of file you wish to download from Internet. Its format is ftp:// or http://.<br><a name=http_name></a><b>User Name(optional): </b>This filed is optional. Please input the server&apos;s username here if the server requires it. The maximum length of user name is 32 characters.<br><a name=http_password></a><b>Password (optional): </b>This field is optional. Please input the server&apos;s password here if the server requires it. The maximum length of password is 32 characters.<br><b>Add: </b>Click \&quot;Add\&quot; button to add a new download task.<br><b>Reset: </b>Click \&quot;Reset\&quot; button to reset all input content.</p><hr><p><a name=http_table></a><b>Download Information Table</b></p><p><b>Pause: </b>Click \&quot;Pause\&quot; button to pause a downloading task.<br><b>Resume: </b>Click \&quot;Resume\&quot; button to resume a paused task.<br><b>Delete: </b>Click \&quot;Delete\&quot; button to delete an existed task.</p><hr><p><a name=http_table></a><b>Downloaded Files</b></p><p><b>Remove History: </b>Click \&quot;Remove History\&quot; button to remove all completed download task.</p>",
"GDH03" : "<p><b>BT Download</b> allows user to download files from Internet through BT protocol.</p><hr><p><a name=bt_loc></a><b>Torrent Location: </b>Specify a torrent file location, click \&quot;Browse\&quot; button to select the torrent file from a PC or USB Storage Device.<br>",
"GDH04" : "<p><b>eDonkey Download</b> allows user to download files from Internet through eD2K protocol.</p><hr><p><a name=emule_url></a><b>eDonkey Download Link: </b>This is an Internet address and indicates the URL of file you wish to download from Internet. Its format is ed2k://.<br>",
"GDH05" : "<p>You can install a new version of NETGEAR Downloader application through this page.</p><p><a name=check></a>Please click \&quot;<b>Check</b>\&quot; button, then router will automatically check if there is a <b>new version</b> NETGEAR Downloader application on <b>NETGEAR</b> website. If a new version one is detected, you can visit <b>NETGEAR</b> website to get it.</p>",
"GDH06" : "<P><font size=4><B>NETGEAR Downloader Settings help</B></font></p><HR><a name=gd_down_speed></a><P><B> Total Max Concurrent Download Tasks </B><p>Specify the maximum number of simultaneous download tasks. The default setting is based on the wireless router CPU computing power and DRAM size.</p><P><B>Maximum Download Speed Per Service(0 means no limit)</B></P><p>This setting limits your maximum download speed (the unit is KB/s) for each service, HTTP/FTP, BT, or eDonkey. The default setting is 0 (0 means there is no limit to your download speed).</p><a name=gd_up_speed></a><p><B>Maximum Upload Speed Per Service(0 means no limit) </B></p><p>This setting limits your maximum upload speed (the unit is KB/s) for each service, HTTP/FTP, BT, or eDonkey. The default setting is 0 (0 means there is no limit to your upload speed).</P><a name=gd_task_num></a><P><B> Enable Auto Status Refresh </B><p>Enable this option to automatically refresh the downloading task status. If not enabled, the status is only updated when the &quot;Refresh&quot; button is clicked. Auto Status Refresh requires more CPU power, so if you enable it, other router functions might become slower.</p><P><B> Send an Email Notification </B><p>Enable this option to send email notifications when downloading tasks are completed. Use the &quot;Configure Email&quot; button to configure your email account information. </p>",
"TVM_001" : "FastTrack",
