"TVM_005" : "WiFi Connection & FastTrack Push Button",
"TVMH_001" : "<B>FastTrack <\B> The first time you turn on FastTrack, you need to specify the bandwidth that you want to reserve, and set up the push button for FastTrack. Fill in all the fields on this screen, and click <B>Apply<\B> so your changes take effect.<B>FastTrack  Status:<\B> This field shows whether FastTrack is currently turned on or off.<B>Turn on FastTrack: <\B> By default, FastTrack is turned off, and the push button on the front or rear panel works as a WPS (Wi-Fi Protected Setup) button. (If your wireless router does not have a physical WPS button, go to the FastTrack tab in the GUI to configure it.) To turn on FastTrack, select this check box. <B>Bandwidth Reserved for Trusted IP Address<\B> Specify what percentage of the bandwidth on the wireless router to reserve when you connect from a trusted IP address. This prevents others from using up your bandwidth. When you connect to the router from the trusted IP address, you then have guaranteed bandwidth for video streaming applications. There are 4 options: 50%, 60%, 70%, and 80%.<B>Push Button:<\B> You can set up the push button on the front panel to work in two different ways: WPS (default) or FastTrack. Select the radio button for the option that you want.",
