"IPMAC08" : "ARP Protection",
"IPMAC09" : "This function is designed to protect your router from ARP attacks.With this function enabled, the Address Reservation table is used as the static ARP table. No more ARP responses from LAN ports will be processed. Devices not registered in this table will not have Internet access.<br />To enable this feature, select the check box above, and click the &quot;Apply&quot; button. Once enabled, use the &quot;Edit&quot; button below to manually configure the IP-MAC binding pairs.",
"IPMAC10" : "If the last device is deleted, no device can access the router interface.",
"IPMAC11" : "If the rule is configured incorrectly, no device will be able to access to the router interface.",
"IPMAC12" : "You can use the Edit button on this screen to directly access the address reservation table.",
"IPMACH01" : "IP-MAC binding protects your router from ARP attacks. With this function enabled, your router uses the IP-MAC binding table as the static ARP table. You can add, remove, or edit the IP-MAC binding pairs in the table. WARNING! Devices that are not registered in this table will NOT have internet access. Ensure that at least one LAN device&apos;s IP and MAC address pair is registered in this table.",
"IPMACH02" : "Use this page to add IP-MAC binding pair. You can either select an entry from the existing device list, or manually configure an IP-MAC address pair.",
"IPMACH03" : "<p><font size=4><B>ARP Protection/IP-MAC Binding Help</B></font></p><HR><p>You can use the Edit button on this screen to directly access the address reservation table.</p><p>IP-MAC binding protects your router from ARP attacks. With this function enabled, your router uses the IP-MAC binding table as the static ARP table. You can add, remove, or edit the IP-MAC binding pairs in the table. <B>WARNING!</B> Devices that are not registered in this table will NOT have internet access. Ensure that at least one LAN device&apos;s IP and MAC address pair is registered in this table.</p>",
