"ASMH01" : "<P><font size=4><B>SmartZone Help</B></font></P><p>SmartZone is Netgear proprietary feature to dynamically improve your wireless devices connection experiences in environment with a Netgear wireless router and extender(s). It provides services to find a better access points dynamically when your wireless devices connecting in SmartZone network.</p><p>When enabled, SmartZone capable devices will discover nearby devices and united as a SmartZone network if using same wireless SSID, security type, and password settings.</p><br><P><font size=4><B>Enable SmartZone</B></font></p><p>When enabled, device will discover and collaborate with other SmartZone device(s).</p><br><P><font size=4><B>Roaming Sensitity</B></font></p><p>The option defines how aggressiveness SmartZone dynamically find a better access point for your wireless device(s).</p><br><p><font size=4></div>",
"ASMH02" : "<P><font size=4><B>SmartZone Help</B></font></P><p>SmartZone is Netgear proprietary feature to dynamically improve your wireless devices connection experiences in environment with a Netgear wireless router and extender(s). It provides services to find a better access points dynamically when your wireless devices connecting in SmartZone network.</p><p>When enabled, SmartZone capable devices will discover nearby devices and united as a SmartZone network if using same wireless SSID, security type, and password settings.</p><br><p><font size=4><B>Wireless Topology Map</B></font></P><p>It shows all wireless devices in SmartZone network including router, extender, and your devices. You can click on any nodes shown on the map to have detail information.</p><p>If you are accessing this web page from a wireless device, the device you used will be highlighted in yellow on the map.</p><br><p><font size=4><B>Modify</B></font></P><p>Modify SmartZone device&apos;s hostname.</p><br><p><font size=4><B>Switch</B></font></P><p>Change Extender&apos;s uplink access point.</p><br><p><font size=4><B>Connect</B></font></P><p>Force wireless station connects to another access point</p><br></div>",
