"RAEM12" : "<a tabindex=-1 href=&quot;javascript:loadhelp(&apos;_rae_router&apos;,&apos;mode&apos;)&quot;><b>Router Mode:</b></a>This mode allows you to take advantage of NETGEAR router functions. The NETGEAR router is set up as a normal WiFi router behind your existing router or gateway. This mode requires that all of your devices be connected to the new NETGEAR router and not to your existing gateway.",
"RAEM13" : "<a tabindex=-1 href=&quot;javascript:loadhelp(&apos;_rae_extender&apos;,&apos;ext_mode&apos;)&quot;><b>Extender Mode:</b></a> The NETGERA router will functin as a range extender. This mode allows you to extend the range of your existing WiFi network",
"RAEM14" : "Select an existing network you would like to extend. You can extend 2.4G band, 5G band, or both of them.",
