"RAEM16" : "Ethernet ports to wifi use the folowing band",
"RAEM17" : "<A tabindex=-1 href=&quot;javascript:loadhelp(&apos;_rae_ap&apos;,&apos;ip_tag&apos;)&quot;><b>AP Mode:</b></a>The NETGEAR router will function as a wireless accesspoint.This mode is appropriate for easy setup if devices are already connected to your existing router or gateway, or if you just want to use this new NETGEAR router to extend your WiFi coverage. Some router functions are not available in access point mode.",
"RAEM18" : "<p>If you want to extend your WiFi coverage, you can also setup your router in range extender mode. The WiFi Range Extender extends the wireless network to include the area outside the range of your existing WiFi network. To setup this mode, connect your NETGEAR Router to the existing Router/Gateway’s SSID. NETGEAR recommends that you connect to the Extender wireless network only when a PC or wireless device is in a “dead zone” where the network connection to your existing router is very poor or nonexistent. This is because data traffic routed through the Extender wireless network is slower than traffic directly from the original wireless router network.</p><p>In this mode, by default, the new router&apos;s IP address is assigned by your gateway dynamically and is unlikely to be 192.168.1.1. However, you can still use the URL http://www.routerlogin.net to access the router&apos;s management GUI from a device connected to the router. Some router functions are not available in this mode, and you must use router mode if you want to use those functions</p>",
"RAEM19" : "Please use your wireless profile manager software (Windows,NETGEAR Adapter Wizard,etc) re-connect to the Extender network using the information displayed below.",
"RAEM20" : "To ensure the delivery of optimal wireless performance to your devices, NETGEAR recommends that you keep a unique SSID for the Extender network and you only connect to the Extender network when the existing network does not deliver good enough coverage",
"RAEM21" : "copy password",
"RAEM22" : "I have connected to the Extender network",
"RAEM23" : "Do you want to close this window?",
"RAEM24" : "2.4GHz Extender Network",
"RAEM25" : "5GHz Extender Network",
"RAEM26" : "Name (SSID)",
"RAEH1" : "<p><font size=4><b>Router Mode Help</b></font></p><a name=mode></a><p><b>Router Mode:</b> This mode allows you to take advantage of NETGEAR router functions. The NETGEAR router is set up as a normal WiFi router behind your existing router or gateway. This mode requires that all of your devices be connected to the new NETGEAR router and not to your existing gateway.</p><p><b>Router Functions</b></p><p>The following router functions are not available if you choose access point or extender mode:</p><ul><li>Guest network</li><li>Parental control</li><li>QoS</li><li>Access control</li><li>Traffic meter</li><li>Block sites</li><li>Block sites</li><li>Block services</li><li>Static route</li></ul><a name=inet></a><p><b>Internet Settings:</b> link to the ADVANCED -> Setup -> Internet Setup page, use this page to modify current router internet settings.</p><a name=wifi></a><p><b>Wireless Settings:</b> link to the ADVANCED -> Setup-> Wireless Setup page, use this page to modify current router wireless settings.</p>",
"RAEH2" : "<p><font size=4><b>AP Mode Help</b></font></p><a name=ip_tag></a><p><b>AP mode:</b> allows this device to work as a stand-alone wireless access point on your existing network. This mode is appropriate for easy setup if devices are already connected to your existing router or gateway, or if you just want to use this new NETGEAR router to extend your WiFi coverage. Some router functions are not available in access point mode.</p><p><b>Router Functions</b></p><p>The following router functions are not available if you choose access point or extender mode:</p><ul><li>Guest network</li><li>Parental control</li><li>QoS</li><li>Access control</li><li>Traffic meter</li><li>Block sites</li><li>Block sites</li><li>Block services</li><li>Static route</li></ul><a name=mac_tag></a><p><b>Get dynamically from existing router</b></p><p>The device will find an IP address automatically from DHCP server</p><a name=name_tag></a><p><b>Use fixed IP Address</b></p><p>Use this option if you want to manually configure IP address, subnet mask, gateway IP address, and DNS server IP address.</p><a name=priority_tag></a><p><b>Wireless Settings:</b>  link to the ADVANCED-> Setup ->Wireless Setup page, use this page to modify current Access Point wireless settings.</p>",
"RAEH3" : "<p><font size=4><b>Extender Mode Help</b></font></p><a name=ext_mode></a><p><b>Extender mode:</b> The WiFi Range Extender extends the wireless network to include the area outside the range of your existing WiFi network. NETGEAR recommends that you connect to the Extender wireless network only when a PC or wireless device is in a “dead zone” where the network connection to your existing router is very poor or nonexistent. This is because data traffic routed through the Extender wireless network is slower than traffic directly from the original wireless router network. </p><p>If you cannot connect from your wireless device to the Extender, move the Extender to a different location halfway between the device and the router. If, after you try several locations, the device cannot connect to the Extender, move the Extender closer to the device.</p><a name=dyn></a><p><b>Get dynamically from existing router</b></p><p>The device will find an IP address automatically from DHCP server</p><a name=fix></a><p><b>Use fixed IP Address</b></p><p>Use this option if you want to manually configure IP address, subnet mask, gateway IP address, and DNS server IP address.</p><a name=uplink></a><p><b>Uplink</b></p><p>2.4G/5G: use these tabs to switch between 2.4G uplink settings and 5G uplink settings. Choose one band, then choose the SSID of your existing Router / Gateway. A popup will display the SSID, and the security option, fill in the password to get connected. You can use the scroll bar to move the list up and down. If you do not see the existing Router / Gateway SSID on the list, please click &quot;Other&quot;, type in the SSID, choose security option from the drop down list, and type in the password. The connected band will show a check mark on the tab.</p><a name=wireless></a><p><b>Wireless Settings:</b> link to the ADVANCED -> Setup -> Wireless Setup page, use this page to modify current Access Point wireless settings.</p><a name=ethport></a><p><b>Ethernet ports to WiFi use the following band</b></p><p>Please choose by which WiFi bands you want to bind the Ethernet ports with. Please make sure you binds with the WiFi band that you have setup the uplink connection.</p><p><b>Uplink Connection Failed</b></p><p>If your connection to the root AP failed, indicated by    on GUI, please check the following items:</p><p>&nbsp;&nbsp;Check if you have entered the correct passphrase for the uplink SSID.</p><p>&nbsp;&nbsp;Try move the extender closer to your root AP or to a position with a better line of sight.</p><p>&nbsp;&nbsp;If you have Access Control List (ACL) enabled in your root AP, please make sure you have added below MAC address into your router’s Access Control List (ACL).</p><ul><li>Extender MAC address is: XXXXX</li><li>Your client wireless adapter MAC address is: XXXXX</li></ul>",
