"DNH1" : "<p><font size=4><b>Device Name Help</b></font></p><p><b>Device Name:</b> device name identifies this router. It is provided to client devices connected to the router to recognize this device. </p><p>It should start with letter and should contain only letters, number, ‘-‘ and ‘_’ symbols, [a-zA-Z]+[a-zA-Z0-9\-\_].The maximum length is 16 characters</p>",
