"PLC016" : "<P><font size=4><B>DST Settings Help</B></font></P><p><font size=3><B>DST Router Name</B></font></p><p>This is a mnemonic or meaningful name that users use to identify this DST device. This name could be up to 12 characters. The default Device Name is the model name of the device. YOu can edit this text field then apply the device name after clicking “Apply” button.</p><p><font size=3><B>DST Router Encryption Key Settings</B></font></p><p>There are two options to let user select what DST encryption key he want.<br><br><b>Use current encryption key:</b> When user select this option, the current encryption key automatically displays in the field. This field is not editable. If customer never change the key yet, which mean here will show the factory default encryption key. The default encryption key is HomePlugAV. Every time when user login this DST Settings page or refresh this page, this option is selected.<br><br><b>Create new encryption key:</b> User can set his own network encryption key in the field. This Encryption Key could be maximum up to 64 characters.</p><p><font size=3><B>Configure remote DST settings:</B></font></p><p>Here has a table that user can see the information about each DST device have been detected. <br><B>Device Name:</B> This lists the DST devices detected on the DST network. User can edit it to a descriptive name such as Office or Kitchen. This name could be up to 12 characters<br><B>Model Name:</B> This identifies the model number of the DST adapter.<br><B>MAC Address:</B> The MAC address for the DST device. This is also on the product label, which might not be visible when the device is plugged in.<br><B>LED Status:</B> This shows the LED status of remote DST device. User can select “ON” or “OFF” option to configure remote DST device LED.<br><B>Encryption Key:</B> When the <I>Use default encryption key</I> option is selected, this option is gray out and un-checked. When the “Create new encryption key” option is selected, this option is NOT gray out and user can check or un-check this option. If the option is checked, the remote DST device will use the same encryption key as local DST device.<br></p><p><font size=3><B>LED Status</B></font></p><p>User can turn on or off the DST LED. The default value is ON.</p>",
"PLC017" : "<P><font size=4><B>DST Status Help</B></font></P><p><font size=3><B>DST Firmware Version</B></font></p><p>Show the firmware version of local DST device.</p><p><font size=3><B>DST Link Status</B></font></p><p>Show the Link status of local DST device.</p><p><font size=3><B>Remote DST Adapter Status</B></font></p><p>Show the firmware version of local DST device. <br><B>Device Name:</B>This lists the remote DST adapter name which detected on the DST network.<br><B>Model Name:</B> This identifies the model number of the DST adapter.<br><B>Tx Rate (Mbps):</B> The rate at which the device is transmitting data.<br><B>Rx Rate (Mbps):</B> The rate at which the device is receiving data.<br><B>MAC Address:</B> The MAC address for the remote DST adapter. This is also on the product label, which might not be visible when the device is plugged in.<br><B>IP Address:</B> The IP address for the remote DST adapter. <br><B>Firmware Version:</B> The firmware version for the remote DST adapter.<br><B>LED Status:</B> The LED status for the remote DST adapter.<br></p>",
