"PLC051" : "<p><font size=&quot;4&quot;><b>DST Settings Help</b></font></p><p><font size=&quot;3&quot;><b>DST Router Name</b></font></p><p>This is a mnemonic or meaningful name that users use to identify this DST device. This name could be up to 12 characters. The default Device Name is the model name of the device. You can edit this text field then apply the device name after clicking &ldquo;Apply&rdquo; button.</p><p><font size=&quot;3&quot;><b>DST Router Encryption Key Settings</b></font></p><p>There are three options to let user select what DST encryption key he want.<br><br><b>No change to the encryption key:</b> this is default option when user see this page for the key setting. No need to show any information for this option. If user keep selecting this option, after user click &ldquo;Apply&rdquo; button, we don&rsquo;t need to change the key or apply the same key again. Which mean the DST network will not be disconnected.<br><br><b>Use default encryption key:</b> When user select this option, the factory default encryption key automatically displays in the field. The default network encryption key is <b>HomePlugAV</b>. After user click &ldquo;Apply&rdquo; button, this default network encryption key will be applied on this device.<br><br><b>Create new encryption key:</b> User can set his own network encryption key in the field. This Encryption Key could be maximum up to 64 characters.</p><p><font size=&quot;3&quot;><b>Configure remote DST settings:</b></font></p><p>Here has a table that user can see the information about each DST device have been detected. <br><b>Device Name:</b> This lists the DST devices detected on the DST network. User can edit it to a descriptive name such as Office or Kitchen. This name could be up to 12 characters<br><b>Model Name:</b> This identifies the model number of the DST adapter.<br><b>MAC Address:</b> The MAC address for the DST device. This is also on the product label, which might not be visible when the device is plugged in.<br><b>Key Type:</b> this shows the key type of remote DST device. There is only two types, one is &ldquo;Public&rdquo; the other is &ldquo;Private&rdquo;. <br><b>Encryption Key:</b> When the <i>Use default encryption key</i> option is selected, this option is gray out and un-checked. When the &ldquo;Create new encryption key&rdquo; option is selected, this option is NOT gray out and user can check or un-check this option. If the option is checked, the remote DST device will use the same encryption key as local DST device.<br><b>LED Status:</b> This shows the LED status of remote DST device. User can select &ldquo;ON&rdquo; or &ldquo;OFF&rdquo; option to configure remote DST device LED.<br></p></div>",
