"PLC069" : "<P><font size=4><B>DST Settings Help</B></font></P><p><font size=3><B>DST Router Name</B></font></p><p>This is a mnemonic or meaningful name that users use to identify this DST device. This name could be up to 12 characters. The default Device Name is the model name of the device. You can edit this text field then apply the device name after clicking &quot;Apply&quot; button.</p><p><font size=3><B>DST Router Encryption Key Settings</B></font></p><p>There are three options to let user select what DST encryption key he want.<br><br><b>No change to the encryption key:</b> this is default option when user see this page for the key setting. No need to show any information for this option. If user keep selecting this option, after user click &quot;Apply&quot; button, we don’t need to change the key or apply the same key again. Which mean the DST network will not be disconnected.<br><br><b>Use default encryption key:</b> When user select this option, the factory default encryption key automatically displays in the field. The default network encryption key is <i>HomePlugAV</i>. After user click &quot;Apply&quot; button, this default network encryption key will be applied on this device.<br><br><b>Create new encryption key:</b> User can set his own network encryption key in the field. This Encryption Key could be maximum up to 64 characters.</p><p><font size=3><B>Configure remote DST settings:</B></font></p><p>Here has a table that user can see the information about each DST device have been detected. <br><B>Device Name:</B> This lists the DST devices detected on the DST network. User can edit it to a descriptive name such as Office or Kitchen. This name could be up to 12 characters<br><B>Model Name:</B> This identifies the model number of the DST adapter.<br><B>MAC Address:</B> The MAC address for the DST device. This is also on the product label, which might not be visible when the device is plugged in.<br><B>Key Type:</B> The key type of remote DST device. There is only two types, one is &quot;Public&quot; the other is &quot;Private&quot;. If the current key is <i>HomePlugAV</i> then the key type shows &quot;Public&quot;, if not then shows &quot;Private&quot;.<br><B>Encryption Key:</B> When the <I>Use default encryption key</I> option is selected, this option is gray out and un-checked. When the &quot;Create new encryption key&quot; option is selected, this option is NOT gray out and user can check or un-check this option. If the option is checked, the remote DST device will use the same encryption key as local DST device.<br><B>LED Status:</B> This shows the LED status of remote DST device. User can select “ON” or “OFF” option to configure remote DST device LED.<br></p></div>",
