"EAggr_help001" : "<P><font size=4><B>Ethernet Port Aggregation</B></font></P><p>Ethernet port aggregation allows the router to combine Ethernet port 1 and port 2 for data transfer to a supporting device, such as a NAS. Note that Ethernet port aggregation is also referred to as link aggregation, teaming port, and port trunking.</p><p name=agg_setup id=agg_setup></p><p><b>Environment Setup</b><p><ol><li>Connect a device that supports Ethernet port aggregation, such as a NAS or network switch, to Ethernet port 1 and port 2 on the router with Ethernet cables.</li><li>Set up Ethernet port aggregation on the device that is connected to Ethernet port 1 and port 2 on the router.</li> For more information about how to set up Ethernet port aggregation on your device, see the documentation that came with your device.<br></ol><p name=agg_config id=agg_config></p><p><b>Router Configuration</b><p><ul><li>Disable. Disables the Ethernet port aggregation function on the router. Ethernet port 1 and port 2 can be used as independent Ethernet ports.<li>Dynamic (IEEE 802.3ad). The router communicates with the device connected to Ethernet port 1 and port 2 on the router, and checks if Ethernet port aggregation capability is supported on the device. <br>If Ethernet port aggregation capability is supported, the router automatically trunks Ethernet port 1 and port 2. If not, Ethernet port 1 and port 2 work as independent Ethernet ports. </ul><p name=agg_status id=agg_status></p><p><b>Ethernet Port Aggregation Status</b><p><ul><li>Inactive. An Ethernet port aggregation device is not connected to Ethernet port 1 and port 2 on the router.<li>Active. An Ethernet port aggregation device is connected to Ethernet port 1 and port 2 on the router. </ul>",
"EAggr_help002" : "<P><font size=4><B>Ethernet Port Aggregation</B></font></P><p>Ethernet port aggregation allows the router to combine Ethernet ports 1 and 2 for data transfer to a supporting device, such as a NAS. Note that Ethernet port aggregation is also referred to as link aggregation, teaming port, and port trunking.</p><p name=agg_setup id=agg_setup></p><p><b>Environment Setup</b><p><ol><li>Connect a device that supports IEEE-802.3ad LACP, such as a NAS or network switch, to Ethernet ports 1 and 2 on the router with Ethernet cables.</li><li>Set up Ethernet port aggregation on the device that is connected to Ethernet ports 1 and 2 on the router</li> <li>If you are connecting port 1 and 2 to an Ethernet switch, please make sure it must support 802.3ad LACP, and configured switch properly before connecting to the router with two Ethernet cables.</li><li>Please do not plug in the un-managed switch to port 1 and port 2, which will bring down your network due to broadcast looping.</li><br>For more information about how to set up Ethernet port aggregation on your device, see the documentation that came with your device.<br><br>Tip: To get the fastest performance with port aggregation, for wired connections use Ethernet port 3 for the first computer, and use Ethernet port 4, 5 or 6 for the second computer which allows for speeds up to 2 Gbps with port aggregation. The maximum speed between port 4, 5 & 6 is limited to 1 Gbps.<br></ol><p name=agg_config id=agg_config></p><p><b>Router Configuration</b><p><ol><li>Disable: Router disable the Ethernet Port Aggregation function. The LAN port 1 and port 2 is working.<li>Enable (LACP- IEEE 802.3ad): Router will communicate with devices connected on LAN port 1 and port 2, and check if it has link aggregation capability. <br>If yes, router will automatically trunking LAN port 1 and port 2. If not, LAN port 1 and port 2 will work as normal LAN port.</ol><p name=agg_status id=agg_status></p><p><b>Ethernet Port Aggregation Status</b><p><ol><li>Inactive: No link aggregation device connected on LAN port 1 and port2.<li>Active: Theres link aggregation device connected on LAN port 1 and port 2.</ol>",
