"plex_025" : "Updating…",
"plex_026" : "<p><font size=4><b>Plex Media Server Help</b></font></p><a name=ip_tag></a><p>Plex Media Server manages your music, video, and photos that are stored on a locally attached USB storage drive, and streams these media files to your devices, such as desktop computers, mobile phones, and tablets.</p><p>These devices can be connected to your router remotely or locally. To connect to your router locally, use a wired Ethernet connection or WiFi connection.</p><p>Plex Media Server is enabled by default. However, you can disable it if you do not want to use it.</p><p>If Plex does not detect that a USB storage drive is attached to the router, Plex is unavailable until a drive is attached.</p><p>If multiple USB storage drives are attached, you can designate one USB drive for use by the Plex Media Server to store and keep the media files and their associated metadata files.</p><p>The router periodically checks for new Plex binary version updates when new features or bug fixes are available. If a new version is found, you must log in to the router and manually update the Plex Media Server to the new version.</p><p>If you enable the automatic update, when a new binary version update is available, the router automatically performs the update at 3:00 a.m. This allows for fewer disruptions while you are streaming media during other hours.</p><p>Note that Plex Media Server restarts after the new version update or after the USB storage drive is changed.</p><p>Your router supports a NAS-based local network drive using the Samba protocol for the Plex media libraries. Follow the router GUI to add a network connection. The connection displays on the Plex Media Server page. Check with your network drive manufacturer for instructions about sharing a folder to other network devices.</p><p>You must use a USB 3.0 storage device for Plex metadata and configuration files. The USB storage device must have at least 5 GB of space.</p>",
