"ACBH_001" : "<p><font size=4><B>Cloud Backup Help</B></font></p><p><B>New users, sign up here for 6 months free:</B> If you don&apos;t have the Amazon Drive Cloud accounts, you could get 6 months free accounts by clicking the link and follow the Amazon Drive Cloud webpage.</p><p><B>Existing users, log-in here:</B> If you already have Amazon Drive Cloud accounts, please click this link to login to your account.</p>",
"ACBH_002" : "<p><font size=4><B>Cloud Backup Help</B></font></p><p><B>Log-in or Sign-up here:</B> If you already have Amazon Drive Cloud accounts, please click this link to login to your account or signup here.</p>",
"ACBH_003" : "<p><font size=4><B>Cloud Backup Help</B></font></p><p><B>Apply Button:</B> Click the Apply button to save any changes made to this page.</p><p><B>Cancel button:</B> Click the Cancel button to return to the previous settings.</p><p><B>Switch Account button:</B> Click the Switch Account button to log out of your current account and return to the log in page.</p><p><b>Your Amazon Drive Cloud account is:</B> This section shows your account name.</p><p><B>Set Up Email Notifications:</B> Click this link to go to manage your email notifications.</p> <p><B>USB Status: Connected | USB Status: Disconnected:</B> The USB status shows the current connection status of your USB device.</p><p><B>Select folder to back up:</B> Select a folder on your USB device that you want to back up to the Cloud.</p><p><B>Change Folder to back up:</B> After you select a folder, you can click the Change Folder link to change the folder.</p><p><B>Backup Now button:</B> Click the Backup Now button to backup immediately.</p><p><B>Select Backup Schedule:</B></p><ul><li><B>Real-time sync:</B> The default backup schedule is real-time sync, which means that whenever the data on your USB device changes, it is backed up to cloud in real time.</li><li><B>Backup on schedule:</B> Back up on schedule means you can select the day and time to back up your data to the cloud.</li></ul><p><b>Success! Backup Complete:</B> This message notifies you that the last backup job completed successfully.</p><p><B>Backup Failed Error Details >>:</B> This message notifies you that the last backup job failed. For more information, click Error Details.</p>",
"h_dsl_bas=" : "To Apply or Cancel </b></p><p>Click <b>Apply</b> to save the new settings to the Router. <br>Click <b>Cancel</b> to disregard any unsaved changes.",
