"usb_dev_setting_h=" : "<h1 class=\&quot;helpfile\&quot;>USB Drive Settings Help</h1> <p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>The DGN2200 allows file sharing when a USB hard drive or flash memory is connected to the USB port.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Please consult the Reference Manual for detailed configuration information.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>To access the USB Drive via FTP, use any FTP tool or type ftp://readyshare</a> in a Web browser such as Microsoft Internet Explorer or Firefox.  The IP Address entered is the Web IP address of the router,  which can be located on the Router Status menu as the IP address of the Internet Port. </span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> To access the USB Drive via Microsoft network connections, click Windows Start -&gt; Run and type \\readyshare .  The IP Address entered is the local IP address of the router, for example, 192.168.0.1. Typing \\hostname in Windows Explorer is also an alternative.  The hostname entered is the Host Name specified in the Network Access section,  for example, DGN2200.</span></p><hr><a name=\&quot;network access\&quot;> </a><h2>Network Access</h2><p class=\&quot;MsoNormal\&quot;><b>Host Name &amp; Workgroup </span></b></p><p class=\&quot;MsoNormal\&quot;> <span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> The Host Name and workgroup combination is the name used to identify  the router in your network. The attached USB drive can be easily accessed by typing  \\hostname in Windows Explorer.</span></p><p class=\&quot;MsoNormal\&quot;> <b>FTP Port</b></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> FTP port is the TCP port number of the embedded FTP server. The default value is 21. </span></p><hr><a name=\&quot;ftp access\&quot;></a><p class=\&quot;MsoNormal\&quot;> <b><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> FTP Access</span></b></p><p class=\&quot;MsoNormal\&quot;> <span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> FTP accounts can be created by clicking the Add button.  These FTP accounts will allow users on the LAN or Internet to access the files on the attached USB drive.</span></p><p><b>To Add , Edit, Delete</b> or <b>Eject Disk</b><br><br>Click <b>Add</b> to add a new information. Click <b>Edit</b> to edit the selected information.  Click <b>Delete</b> to delete the selected information. Click <b>Eject Disk</b>  to eject the USB device.<br></p><hr><a name=\&quot;attached device\&quot;></a><p class=\&quot;MsoNormal\&quot;> <b><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Attached Device</span></b></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot;  style=\&quot;font-family:Arial\&quot;> This table shows the partition information of the attached USB drive, including the share name and file system type.&nbsp;</span></p>",
