"usb_wiz_h=" : "<h1>Vista Settings Help</h1><p><b>Device Name</b><br>This is a friendly name for this router. You can see the router shown in the Vista network map and network explorer is marked with this name.</p><p><b>Enable Built-in Registrar</b><br>When the Built-in Registrar is enabled, you can use the function of \&quot;Add Wireless Client\&quot; at this page to add a wireless client into the network through the WPS procedure. In this case, you do not need a Windows Vista PC to add a wireless client.</p><p><b>Allow a Registrar to Configure This Router</b><br>Check this option to let users use a Windows Vista PC to configure the router. With a default router configuration, users can configure the router through the Windows Vista PC. However, once the router has been configured by a Registrar, you have to check this option in order to let a Registrar be able to configure the router again. When the Built-in Registrar has been enabled, this option becomes inactive.</p><p><b>Add a Wireless Client </b><br>When the Built-in registrar is enabled, you can add a wireless client into the network by clicking this button first. Then a dialog box prompts out and asks for the client&apos;s PIN. The client&apos;s PIN should be displayed on the client&apos;s GUI.</p>",
