"h_wlg_sec_profile=" : "<H1>Security Profile Settings Help</H1><P>This Router allows you to have multiple Wireless Networks. Details of each Wireless Network are contained in a Security Profile. Details of each Security Profile are listed. <UL><LI>Profile Name <BR>The current profile name is displayed. <LI>SSID <BR>The current SSID associated with this profile. <LI>Security <BR>The current security system (e.g. WPA-PSK ) is displayed. <LI>Enable <BR>Use this checkbox to enable or disable each security profile as required. Click <B>Apply</B> to save your changes. <LI>WMM <BR>Use this checkbox to enable or disable WMM advertisement in each security profile. Click <B>Apply</B> to save your changes. <LI>Broadcast SSID <BR>Use this checkbox to enable or disable SSID broadcast in each security profile. Click <B>Apply</B> to save your changes. </UL><p><b>Edit Button</b><br><p>Click this button to change the settings for the selected profile. Use the radio buttons on the left to the select the desired profile. </P>",
