"h_wds" : "<P><font size=&quot;4&quot;><B>Wireless Repeating Function Settings Help</B></font></P> <a name=&quot;en_repeat&quot;></a> <p><b>Enable Wireless Repeating</b></p> <p>Enable this if you wish to use either Bridge mode or Repeater mode, and then select the mode you want for your environment. </p><ul> <p><li><a name=&quot;repeat&quot;></a><strong>Wireless Repeater. </strong> <p>In this mode, the DGN2200 router will communicate <I>only</I> with another Base Station-mode wireless station. You must enter the MAC address (physical address) of the other Base Station-mode wireless station in the field provided. WEP can (and should) be used to protect this communication. <p><li><a name=&quot;base&quot;></a><strong>Wireless Base Station. </strong> <p>Select this only if this DGN2200 router is the master for a group of Repeater-mode wireless stations. The other Repeater-mode wireless stations must be set to Wireless Repeater mode, using this router&apos;s MAC address. They then send all traffic to this master, rather than communicate directly with each other. WEP can (and should) be used to protect this traffic. <p>If this option is selected, you must enter the MAC addresses of the other access points in the fields provided.",
"h_CF_log" : "<P><font size=4><B>Include in Log</B></font></P><p>A log is a detailed record of the websites that users on your network have accessed or attempted to access. If you have set up content filtering on the Block Sites screen, the Logs screen shows you when someone on your network tried to access a blocked site. If you have e-mail notification on, you will receive these logs in an e-mail message. If you do not have e-mail notification set up, you can view the logs here.</p><p><ul><li>Click <b>Clear Log</b> to delete all the log entries.</ul><p><ul><li>Click <b>Refresh</b> to see the most recent access attempts.</ul><p><ul><li>Click <b>Send Log</b> to send the log file to your e-mail account. This feature can be very useful for testing your e-mail settings.</ul><a name=&quot;syslog&quot;></a><P><b>Syslog</b><p>The Logs can be send to a Syslog server. Enable one of these three options, as required:<ul><li> Disable - Select this if you don&apos;t have a Syslog server.<li> Broadcast on LAN  - the Syslog data is broadcast, rather than sent to a specific Syslog server. Use this if your Syslog Server does not have a fixed IP address.<li> Send to this Syslog server IP address - If your Syslog server has a fixed IP address, select this option, and enter the IP address of your Syslog server. </ul><p>&nbsp;</p>",
