"h_wlg_wireless2" : "<H1>Security Profile Definition Help</H1><A name=profile></A><P><B>Profile Defintion</B></P><P>Enter the desired values: <UL><LI>Security Profile Name<BR>Enter a suitable name to identify this profile. This name has no effect on operation. <LI>Wireless Network Name (SSID)<BR>Enter the Network Name (SSID) for this profile.</LI></UL><HR><A name=security></A><P><B>Security Options</B></P><UL><LI>None - no data encryption<LI>WEP - Wired Equivalent Privacy, use WEP 64- or 128-bit data encryption<LI>WPA-PSK [TKIP] - Wi-Fi Protected Access with Pre-Shared Key, use WPA-PSK standard encryption with TKIP encryption type<LI>WPA2-PSK [AES] - Wi-Fi Protected Access version 2 with Pre-Shared Key, use WPA2-PSK standard encryption with the AES encryption type<LI>WPA-PSK [TKIP] + WPA2-PSK [AES] - Allow clients using either WPA-PSK [TKIP] or WPA2-PSK [AES]</LI></UL><p>To achieve the best performance with NETGEAR WN511B or other wirelessadapters under robust security network, NETGEAR recommends that youchange your DGN2200 network&apos;s security option to WPA2-PSK. <!--<p>The WEP and WPA-PSK security options are still supported under &quot;Up to 54Mbps&quot; legacy b/g network, but not available under 130 Mbps and 270 Mbpsmodes now.--></p><HR><A name=wep></A><P><B>Security Encryption (WEP)</B><P>Authentication Type<P>Normally this can be left at the default value of &quot;Automatic.&quot; If that fails,select the appropriate value - &quot;Open System&quot; or &quot;Shared Key&quot; Check your wireless card&apos;s documentation to see what method to use.  <P>Encryption Strength<P>Select the WEP Encryption level:<UL><LI>64-bit (sometimes called 40-bit) encryption<LI>128-bit encryption </LI></UL><HR><A name=wepkey></A><P><B>Security Encryption (WEP) Key</B></P><P>If WEP is enabled, you can manually or automatically program the four data encryption keys. These values must be identical on all PCs and Access Points inyour network.<P>Automatic Key Generation (Passphrase)<P>Enter a word or group of printable characters in the Passphrase box and clickthe Generate button to automatically configure the WEP Key(s). If encryptionstrength is set to 64 bit, then each of the four key boxes will automatically bepopulated with key values. If encryption strength is set to 128 bit, then onlythe selected WEP key box will automatically be populated with key values.<P>Manual Entry Mode<P>Select which of the four keys will be used, and enter the matching WEP key information for your network in the selected key box.<P>For 64-bit WEP - Enter ten hexadecimal digits (any combination of 0-9, A-F). <P>For 128-bit WEP - Enter twenty-six hexadecimal digits (any combination of 0-9, A-F).<P>Be sure to click Apply to save your settings in this menu.</P><HR><A name=wpa-psk></A><P><B>Security Encryption (WPA-PSK)</B></P><P>If selected, you must use TKIP encryption, and enter the WPA passphrase (Network key). Enter a word or group of printable characters in the Passphrase box. The Passphrase must be 8 to 63 characters or 64 hex digits in length.<P>Be sure to click Apply to save your settings. </p><HR><A name=wpa2-psk></A><P><B>Security Encryption (WPA2-PSK)</B></P><P>WPA2 is a newer version of WPA. Only select this if all the wireless clients in your network support WPA2. If selected, you must use AES encryption, and enter the WPA passphrase (Network key). Enter a word or group of printable characters in the Passphrase box. The Passphrase must be 8 to 63 characters or 64 hex digits in length. <HR><A name=wpa-psk+wpa2-psk></A><P><B>Security Encryption (WPA-PSK + WPA2-PSK)</B></P><P>This selection allows clients to use either WPA (with TKIP, broadcast packets also use TKIP.) or WPA2 (with AES). If selected, encryption must be TKIP + AES. The WPA passphrase (Network key) must also be entered. To reach maximum wireless performance, the client like WN511B must connect to this router using WPA2(with AES) .  For clients connecting in WPA-PSK( with TKIP), the maximum wireless speed will be at 802.11g.Enter a word or group of printable characters in the Passphrase box. The Passphrase must be 8 to 63 characters or 64 hex digits in length.<HR><P><B>Authentication Server</P></B><p>Enter the data for your Radius Server, used for Authentication and Access Control. This configuration is required if using either the <B>Legacy 802.1x</B> or <B>WPA</B> with Radius authentication methods. <UL><LI>IP Address (Default: 0.0.0.0)<BR>Enter the IP address of your Radius Server.<LI>Port No. (Default: 1812)<BR>Enter the port number used for communication to this server.<LI>Shared Secret (Default: blank)<BR>Enter the shared secret for this &quot;client&quot; connection to the Radius server, as entered on the Server itself. </LI></UL><P><B>Authentication Settings</P></B><p>Update Global Key <p>Enable this option to have the Global Key changed according to the time interval specified. If enabled, enter the desired time interval. The default value is 3600 Seconds<HR><P><B>To Save Or Cancel Changes</B></P><P>Click <B>Apply</B> when finished to update the Security Profile.<BR>Click <B>Cancel</B> to discard your changes and to return to the previous settings. </P>",
