"h_wiz_pppoa" : "<div class=Section1><h1 class=\&quot;helpfile\&quot;>Help </h1><p>The Basic Settings screens allow you to configure, upgrade, and check the status of your NETGEAR wireless router.</p> <p>Click an item in the leftmost column. The current settings or information for that area appear in the center column. <p>Helpful information related to the selected Settings page appears in this column. If you are using Internet Explorer, you may click an item in the center column to jump directly to the related help section; otherwise, scroll down until you reach it. <hr><a name=\&quot;bsetting\&quot;></a><h1>Basic Settings Help</h1><p><b>Note:</b> If you are setting up the Router for the first time, the default settings may work for you with no changes. <a name=question></a><p><b>Does Your Internet Connection Require A Login?</b> <p>Select this option based on the type of account you have with your ISP. If you need to enter login information every time you connect to the Internet or you have a PPPoE account with your ISP, select <b>Yes</b>. Otherwise, select <b>No</b>. <a name=\&quot;en\c&quot;></a><h2 class=\&quot;helpfile\&quot;>Encapsulation</h2><p>Select the service provided by your ISP. The two choices are PPPoE (PPP over Ethernet) and PPPoA (PPP over ATM).</p><h2 class=\&quot;helpfile\&quot;><a name=\&quot;login\&quot;></a>Login </h2><p>This is usually the name thatyou use in your e-mail address. For example, if your main mail account isJerAB@ISP.com, then put JerAB in this box. </p><p>Some ISPs require that you use your full e-mail address when you log in. If your ISP requires your full e-mail address, then type it in the Login box. </p><a name=\&quot;password\&quot;></a><h2 class=\&quot;helpfile\&quot;>Password</h2><p>Type the password that you use to log in to your ISP. </p><a name=\&quot;idletime\&quot;></a><h2 class=\&quot;helpfile\&quot;>Idle Timeout</h2><p>An idle Internet connection will be terminated after this time period.<p>If this value is zero (0), then the connection will be \&quot;kept alive\&quot; by re-connecting immediately whenever the connection is lost.</p><p><a name=\&quot;InternetIP\&quot;></a><b>Internet IP Address </b><p>If you log in to your service or your ISP did not provide you with a fixed IP address, the Router will find an IP address for you automatically when you connect. Select <b>Get Dynamically From ISP</b>. <p>If you have a fixed (or static IP) address, your ISP will have provided you with the required information. Select <b>Use Static IP Address</b> and type the IP Address, Subnet Mask and Gateway IP Address into the correct fields.<p>For example: <ul><li>      IP Address: 24.218.156.183 <li>      Subnet Mask: 255.255.255.0 <li>      Gateway IP Address: 24.218.156.1 </ul><a name=\&quot;DNSaddress\&quot;></a><h2 class=\&quot;helpfile\&quot;>Domain Name Server (DNS) Address </h2><p>The DNS server is used to lookup site addresses based on their names. </p><p>If your ISP gave you one or twoDNS addresses, select <b>Use These DNS Servers </b>and type the primary andsecondary addresses. </p><p>Otherwise, select <b>GetAutomatically From ISP</b>. </p><p><b>Note: </b>If you get &apos;Address not found&apos; errors when you go to a Web site, it is likely that yourDNS servers aren&apos;t set up properly. You should contact your ISP to get DNSserver addresses. </p><p><a name=\&quot;nat\&quot;></a><b>NAT (Network Address Translation)</b><p>NAT allows all LAN PCs to gain Internet access via this Router, by sharing this Router&apos;s WAN IP address. In most situations, NAT is essential for Internet access via this Router. You should only disable NAT if you are sure you do not require it. When NAT is disabled, only standard routing is performed by this Router.</p><a name=\&quot;buttons\&quot;> </a><h2 class=\&quot;helpfile\&quot;>Apply, Cancel and Test Buttons</h2><p>Click <b>Apply</b> when youfinish changing the settings. </p><p>Click <b>Cancel</b> to returnto the original settings. </p> <p>Click <b>Test</b> to connect to the NETGEAR Web site. If you connect successfully, your settings work and you may click <b>Logout</b> to exit these pages and... enjoy surfing the <b>&apos;net!</b></p><p>If you don&apos;t connect successfully, </p><ul><li>Go through the settings and make sure you&apos;ve selected the correct options and typed everything correctly. </li><li>Contact your ISP to verify the configuration information. </li><li>Read the Troubleshooting section in the <i>Device Installation Guide.</i></li><li>On the <i>Device Resource</i> CD, read the <i>Troubleshooting Guide</i> or the Troubleshooting section in the <i>Reference Guide.</i></li><li>Contact NETGEAR Technical Support.</li></ul> </div>",
