"adsl_info_3" : "<ul><p><strong>The ADSL line is connected to the wrong port on the router.</strong></br>Verify that the ADSL line is connected to the ADSL port on the router. If so, the ADSL light on the router will be lit. The bottom label of the router identifies the location of the ADSL port and status light.</p></ul>",
