"h_dsl_bas" : "<h1 class=&quot;helpfile&quot;>ADSL Settings Help</h1><p>The default parameters should be correct to match the system used by your ISP</p><ul><li>Multiplexing Method - Your ISP will indicate whether your Multiplexing Method is VC-BASED or LLC-BASED.<li>Virtual Circuit - Your ISP will indicate which VPI/VCI combination is used for your service.</ul><p><b>To Apply or Cancel </b></p><p>Click <b>Apply</b> to save the new settings to the Router. <br>Click <b>Cancel</b> to disregard any unsaved changes. <br>",
