"h_modem_status" : "<p><b>Modem</b>: The current Modem status and settings are shown in this section. <ul> <li>ADSL Firmware Version - This is the version number of the low-level ADSL firmware. This is contained within the Router Firmware. <li>Modem Status - the current state of the ADSL connection to your phone company. <li>DownStream Connection Speed - the connection speed of the ADSL connection from the phone company to your Router. <li>UpStream Connection Speed - the connection speed of the ADSL connection from your Router to the phone company. <li>VPI - the VPI setting entered on the ADSL Settings page. <li>VCI - the VCI setting entered on the ADSL Settings page. </ul>",
