"h_syslog" : "<P><b>Syslog</b><p>The Logs can be send to a Syslog server. Enable one of these three options, as required:<ul><li> Disable - Select this if you don&apos;t have a Syslog server.<li> Broadcast on LAN  - the Syslog data is broadcast, rather than sent to a specific Syslog server. Use this if your Syslog Server does not have a fixed IP address.<li> Send to this Syslog server IP address - If your Syslog server has a fixed IP address, select this option, and enter the IP address of your Syslog server. </ul>",
