"usb_edit_h" : "<p class=\&quot;MsoNormal\&quot;><b><span lang=\&quot;EN-US\&quot; style=\&quot;font-size: 14.0pt; line-height: 115%; font-family: Arial\&quot;>USB Drive Setting Help</span></b></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>&nbsp;</span></p><a name=\&quot;status\&quot;></a><p class=\&quot;MsoNormal\&quot;><b><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Status</span></b></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>If Enabled, the FTP account will be activated and allow user to access the USB drive via FTP program.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>&nbsp;</span></p><a name=\&quot;namepass\&quot;></a><p class=\&quot;MsoNormal\&quot;><b><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Login Name and Password</span></b></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>This is the FTP login name and password used to gain FTP access to the USB drive</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>&nbsp;</span></p><a name=\&quot;sharefolder\&quot;></a><p class=\&quot;MsoNormal\&quot;><b><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Share Folder</span></b></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>After a successful FTP login, this folder will become the root or home folder of the FTP session.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>&nbsp;</span></p><a name=\&quot;accessright\&quot;></a><p class=\&quot;MsoNormal\&quot;><b><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Access Rights</span></b></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>If the Read &amp; Write is checked, the FTP user will be able to Read &amp; Write (FTP PUT operation) to the USB drive</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Otherwise, FTP user will have READ only access</span></p><p>?</p>",
