"DG009" : "<P><font size=4><B>Wireless Repeating Function Settings Help</B></font></P><p> To use the wireless repeating function on the modem router, you must set up an uplink router.</p><p><b>To configure an uplink router:</b> </p><ol><li>Select the <b>Enable Wireless Repeating Function</b> check box.</li><li>Input the SSID of the uplink router.<br>You have following options:<ul><li>Click the <b>Check</b> button to find the uplink router and select the radio button next to SSID of the uplink router.</li><li>Type the SSID of the uplink router in the <b>Uplink Router SSID</b> field.</li></ul></li><li> In the <b>Security Options</b> section, select a radio button next to the security mode of the uplink router.<br><b>Note:</b> If you used the <b>Check</b> button to find the uplink router, the security mode is automatically selected.</li><li>In the <b>Passphrase</b> field, type the password of the uplink router. </li><li>Click the <b>Apply</b> button.<br>Your changes are saved. </li></ol>",
