"DG030" : "<h1 class=&quot;helpfile&quot;>ADSL Settings Help</h1><p><b>To change your ADSL settings: </b><p>1. Select the <b>Enable this interface</b> check box.<p>2. Select your application from the menu: <p><ul><li>WAN1<li>IPTV1<li>IPTV2</ul><p>The router automatically changes the following parameters based the application you choose: <p><ul><li><b>Multiplexing Method</b>. Your ISP indicates whether your multiplexing method is VC-BASED or LLC-BASED. <li><b>VPI</b>. Your ISP indicates which VPI/VCI combination is used for your service. <li><b>VCI</b>. Your ISP indicates which VPI/VCI combination is used for your service.</ul><p>3. Select your <b>DSL mode</b> from the DSL Mode menu: <p><ul><li>Auto<li>ADSL<li>ADSL2<li>ADSL2+</ul><p>4. Click the <b>Apply</b> button.<p>Your settings are saved.<p><b>To cancel your changes: </b><p>Click the <b>Cancel</b> button to close the window without saving your changes. <br>",
"DG031" : "<h1 class=&quot;helpfile&quot;>IPTV Setup Help</h1><p>This IPTV Setup option displays only if Russian is selected as the GUI language.<p>This application is limited to an ADSL WAN (not Ethernet WAN) connection.<p><b>To set up IPTV:</b><p>1. Select the LAN and WLAN ports to which the IPTV streaming will bridge. <p>2. Click the <b>Apply</b> button<p>    Your settings are saved.<p><b>To cancel your changes: </b><p>Click the <b>Cancel</b> button to close the window without saving your changes. <br>",
