"vlan_help01" : "<h1 class=helpfile>VLAN Group Settings</h1><BR><a name=port mapping></a><p><b>To edit the port apping configuration: </b><BR><p> 1.Port Mapping supports multiple ports to WAN groups. Each group will perform as an independent network. </p><p> 2.To support this feature, you could add interfaces to the grouped list using the <b>&quot;Add&quot;</b> button.</p><p> 3.The <b>&quot;Remove&quot;</b> button will remove interfaces from group and add its to the Default group.</p><p> 4.Click b>&quot;Apply/Reboot&quot;</b> button to make the changes effective immediately</p><p> 5.Click <b>&quot;Cancel&quot;</b> button to give up the changes.</p><p> 6.If you make any changes to vlan you will need to restart IAD for the settings to take effect.</p>",
