"firewall_help001" : "<h1 class=helpfile>Firewall Rules Help</h1> <p>You can use this screen to create Firewall rules to block or allow specific traffic. <B>This feature is for Advanced Administrators only!</b> Incorrect configuration will cause serious problems.</p><a name=out></a><h2 class=helpfile>Outbound Services</h2><p>This lists all existing rules for outbound traffic. If you have not defined any rules, only the default rule will be listed. The default rule allows all outgoing traffic.<p>To create a new rule:<ol><li>Click the Add button. (It does not matter which radio button is selected)<li>The Outbound Service screen will be displayed. This screen has its own help file. <li>Complete the Outbound Service screen, and save the data. The new rule will be listed in the table when you return to this screen.</ol><p>To make changes to an existing rule:<ol><li>Click the radio button next to a row in the table. </li><li>Click the button for the desired actions:<ul><li>Edit - to make any changes to the rule definition. The Outbound Service screen will be displayed, with the data for the selected rule.<li>Move - to move the selected rule to a new position in the table. You will be prompted for the new position.<li>Delete - to delete the selected rule.</ul></ol><a name=in></a><h2 class=helpfile>Inbound Services</h2><p>This lists all existing rules for inbound traffic. If you have not defined any rules, only the default rule will be listed. The default rule blocks all inbound traffic.<p>To create a new rule:<ol><li>Click the Add button. (It does not matter which radio button is selected)<li>The Inbound Service screen will be displayed. This screen has its own help file. <li>Complete the Inbound Service screen, and save the data. The new rule will be listed in the table when you return to this screen.</ol><p>To make changes to an existing rule:<ol><li>Click the radio button next to an row in the table. </li><li>Click the button for the desired actions:<ul><li>Edit - to make any changes to the rule definition. The Inbound Service screen will be displayed, with the data for the selected rule.<li>Move - to move the selected rule to a new position in the table. You will be prompted for the new position.<li>Delete - to delete the selected rule.</ul></ol><p><b>To Apply Or Cancel  </b></p><p>Click <b>Apply</b> to update changes to the <b>Outbound Services</b> and <b>Inbound Services</b> tables. <br>Click <b>Cancel</b> to disregard any unsaved changes.<br>",
"firewall_help002" : "<h1 class=helpfile>Inbound Service Help</h1> <p>You can use this screen to define a new Inbound Firewall rule, or edit an existing rule.Firewall rules can be used to block or allow specific traffic. <B>This feature is for Advanced Administrators only!</b> Incorrect configuration will cause serious problems.</p><a name=serv> </a><p><b>Service</b><br>Select the desired Service. This determines which packets are covered by this rule. If necessary, you can define a new Service on the Services screen, by defining the protocols and port numbers used by the Service.<a name=action> </a><p><b>Action</b><br>Select the desired action for packets covered by this rule:<ul><li>ALLOW always<li>ALLOW by schedule, otherwise Block<li>BLOCK always<li>BLOCK by schedule, otherwise Allow</ul>Note:<ul><li>Any inbound traffic which is not allowed by rules you create will be blocked by the Default rule.<li>BLOCK rules are only useful if the traffic is already covered by an ALLOW rule. (That is, you wish to block a sub-set of traffic which is currently allowed by another rule.)<li>To define the Schedule used in these selections, use the Schedule screen.</ul><a name=dest></a><p><B>LAN Server</b><BR>Enter the IP address of the PC or Server on your LAN which will receive the inbound traffic covered by this rule.<a name=source></a><p><b>WAN Users</b><BR>These settings determine which packets are covered by the rule, based on their source (WAN) IP address. Select the desired option:<ul><li>Any &nbsp; &nbsp; All IP addresses are covered by this rule.<li>Address range &nbsp; &nbsp; If this option is selected, you must enter the Start and Finish fields.<li>Single address &nbsp; &nbsp; Enter the required address in the Start fields.</ul><a name=log></a><p><b>Log</b><br>This determines whether packets covered by this rule are logged. Select the desired action.<ul><li>Always - always log traffic considered by this rule, whether it matches or not. (This is useful when debugging your rules.)<li>Never - never log traffic considered by this rule, whether it matches or not.</ul><pre></pre><p>Click <b>Apply</b> to have your changes take effect.<p>Click <b>Cancel</b> to return to the previous screen.",
"firewall_help003" : "<h1 class=helpfile>Outbound Service Help</h1> <p>You can use this screen to define a new Outbound Firewall rule, or edit an existing rule.Outbound Firewall rules are used to block or allow access by computers on your network to services or applications on the Internet.</p><a name=serv> </a><p><b>Service</b><br>Select the desired Service or application to be covered by this rule. If the desired service or application does not appear in the list, you must define it using the Services menu.<a name=action> </a><p><b>Action</b><br>Select the desired action for packets covered by this rule:<ul><li>BLOCK always<li>BLOCK by schedule, otherwise Allow<li>ALLOW always<li>ALLOW by schedule, otherwise Block</ul>Note:<ul><li>Any outbound traffic which is not blocked by rules you create will be allowed by the Default rule.<li>ALLOW rules are only useful if the traffic is already covered by a BLOCK rule. (That is, you wish to allow a subset of traffic which is currently blocked by another rule.)<li>To define the Schedule used in these selections, use the Schedule screen.</ul><a name=source></a><p><B>LAN users</b><BR>These settings determine which computers on your network are affected by this rule, based on their source (LAN) IP address. Select the desired option:<ul><li>Any - All local IP addresses are covered by this rule.<li>Address range - If this option is selected, you must enter the Start and Finish fields.<li>Single address - Enter the required address in the Start fields.</ul><a name=dest></a><p><b>WAN Servers</b><BR>These settings determine which Internet locations are covered by the rule, based on their destination (WAN) IP address. Select the desired option:<ul><li>Any - All Internet IP address are covered by this rule.<li>Address range - If this option is selected, you must enter the Start and Finish fields.<li>Single address - Enter the required address in the Start fields.</ul><a name=log></a><p><b>Log</b><br>This determines whether packets covered by this rule are logged. Select the desired action:<ul><li>Always - always log traffic considered by this rule, whether it matches or not. (This is useful when debugging your rules.)<li>Never - never log traffic considered by this rule, whether it matches or not.</ul><pre></pre><p>Click <b>Apply</b> to have your changes take effect.<p>Click <b>Cancel</b> to return to the previous screen.",
