"3G329" : "Setup Wizard Help",
"3G330" : "<p>The NETGEAR mobile broadband router must be configured after it is connected into your network. You can do this using the Setup Wizard -- where the wizard will attempt to make the connection to the Internet service through your ISP -- or you can configure the router manually. It is recommended that, if you aren&apos;t used to setting up Internet connections, you let the Setup Wizard do some of the work for you.",
"3G331" : "<p>To configure the NETGEAR mobile broadband router, you&apos;ll use the information that you filled out earlier in the Installation Guide.",
"3G332" : "<p>To get started, click <b>Next</b>.",
"3G333" : "Your browser doesn&apos;t support print function.",
"3G334" : "<p>Your router uses the following settings. You will need the wireless settings when you set up computers to wirelessly connect to the Internet through this router.</p>",
"3G335" : "<p><strong>Note:</strong> Your Mobile Broadband Service Provider may have data bandwidth usage limit per month. Periodically check with your service provider to ensure you are not over limit on data usage.</p>",
"3G336" : "<p><strong>Important:</strong> Print the screen or write down the settings.</p>",
"3G337" : "<p>Click <strong>Finish</strong> to Complete your Configuration.</p>",
"3G338" : "Wireless Network Name",
"3G339" : "Mobile Broadband Profile Help",
"3G340" : "This page allows you to configure the Mobile Broadband Profiles for your NETGEAR Router",
"3G341" : "<p>A Mobile Broadband Profile represents connection information associated with a SIM card. NETGEAR router allows you to have 5 Mobile Profiles.",
"3G342" : "Mobile Profiles let you quickly connect to Internet with NETGEAR router wirelessly. </p>",
"3G343" : "<p><b>Profile</b> - Profile name, use a name that represents  your mobile broadband account.</p>",
"3G344" : "<p><b>PIN code</b> - PIN code of SIM card</p>",
"3G345" : "<p>Click <b>Check</b> when you want to check and apply input PIN code.</p>",
"3G346" : "<p>Click <b>New</b> to create a new Mobile Profile.</p>",
"3G347" : "<p>Click <b>Edit</b> to replace the selected Mobile Profile with a new one.</p>",
"3G348" : "<p>Click <b>Apply</b> to apply configured Mobile Profiles to connect to Internet.</p>",
