"3G353" : "There are two main modem types for the 3G network: one is UMTS/WCDMA/TD-SCDMA, and the other is CDMA2000 1X/EVDO. Please select your modem&apos;s type according to your modem&apos;s specification.",
"3G354" : "Please select the country name according to your location.",
"3G355" : "Please select the name of your Internet Service Provider (ISP).",
"3G356" : "The PIN (Personal Identification Number) code is usually supplied with the SIM card. It is used to lock your SIM card against unauthorized use. Generally speaking, it is composed of 4 to 8 digits. If you do not know what PIN code should be used, please contact your Internet Service Provider (ISP). Note: In most cases, the user does not need to give a PIN code since most SIM cards have been unlocked before delivery to the user. Besides, a SIM card may be destroyed if a wrong PIN code has been repeatedly used.",
"3G357" : "Access Point Name (APN) is a configurable network identifier used by a mobile device when connecting to a mobile network carrier. The carrier will then examine this identifier to determine what type of network connection should be created  (for example,  what IP addresses should be assigned to the wireless device). If you do not know what APN should be used, please contact your Internet Service Provider (ISP).",
"3G358" : "This is a protocol type used for sending and recieving packets between a modem and a carrier&apos;s mobile network. If you do not know what PDP type should be used, please contact your Internet Service Provider (ISP).",
