"3G496" : "SMS Messages Help",
"3G497" : "<p> Short Message Service (SMS) is a text messaging service. The router must be connected to the network with a valid SIM card.</p><p></p><p>You can view your Inbox, Sent, and Draft folders. Select a folder from the menu to view its contents.",
"3G498" : "<b>Inbox:</b> Summary page of the SMS messages received.<ol>Click a SMS message to display the complete message.<br><b>New:</b> Compose a new message.<br><b>Forward and Reply:</b> Open the selected message to forward or reply to the message.<br><b>Refresh:</b> Retrieve all messages.<br><b>Delete:</b> Delete the selected message.<br><b>Delete All:</b> Delete all messages.</ol>",
"3G499" : "<b>Sent:</b> Summary page of the SMS messages sent.<ol>Click on the selected SMS message to display the complete message <br><b>New:</b> Compose a new message. <br><b>Forward:</b> Open the selected SMS message to forward the message. <br><b>Resend</b> Resend the selected SMS message. <br><b>Delete:</b> Delete the selected SMS message.<br><b>Delete All:</b> Delete all the SMS messages in the SIM Card.</ol>",
"3G500" : "<b>Draft:</b> Summary page of draft SMS messages.<ol>Click on the selected SMS message to display complete message <br><b>New:</b> Compose a new SMS message. <br><b>Edit:</b> Open the selected SMS message to edit the message. <br><b>Send:</b> Send the selected draft SMS message. <br><b>Delete:</b> Delete the selected draft SMS message.</ol>",
"3G501" : "<b>New SMS:</b> Used to create a new SMS or email message.<ol><b>To:</b> The phone number or email address you want to send the message to.<br><b>Content:</b> Message body. The message limit is displayed at the bottom of content box.<br><b>Send button:</b> Press the <b>Send</b> button to send messages.<br><b>Clear button:</b> Press the <b>Clear</b> button will erase message. <br><b>Save button:</b> Press the <b>Save</b> button to save the message to the Draft folder. <br><b>Cancel button:</b> Press the <b>Cancel</b> button  to return to the Inbox.<br>&nbsp;</ol>",
