"genie_171" : "You can use NETGEAR genie to convert a regular printer to an AirPrint-capable printer. Then you can use AirPrint on your Apple iOS devices (iPad, iPhone, or iPod Touch) to print wirelessly.",
"genie_172" : "Step 1: Make sure that your computer can print to the printer.",
"genie_173" : "The printer can be connected to the computer using USB, or it can be connected to the router either wirelessly or using the router’s USB port with NETGEAR ReadySHARE Printer support.",
"genie_174" : "Step 2: Select the printer.",
"genie_175" : "Your iPad, iPhone, or iPod Touch wirelessly connected to the router can now see this printer in its Print function.",
"genie_176" : "To use AirPrint, you have to install the Apple iTunes and Adobe Acrobat Reader applications on your computer if you haven’t already.",
"genie_177" : "For iTunes, go to <a href=&quot;http://www.apple.com/itunes/&quot;><br>http://www.apple.com/itunes/</a> to download and install it.",
"genie_178" : "For Acrobat Reader, go to <a href=&quot;http://get.adobe.com/reader/&quot;><br>http://get.adobe.com/reader/</a> to download and install it.",
"genie_179" : "Click the Refresh button after you have installed both applications.",
"genie_180" : "List of printers this computer can see:",
"genie_181" : "Your message has been sent to NETGEAR. Thank you for your feedback. We read all messages, but NETGEAR might or might not send you a reply. If NETGEAR does reply, it could be several days before the response is sent.",
"genie_182" : "<p>To block or allow one or more devices to access your network, click the Access Control link in the top right corner of this screen to go to the Access Control screen and make changes.",
"genie_183" : "<p><font size=4><B>Access Control Help</B></font></p><p>You can use Access Control to allow or block computer or electronic devices from accessing your network. When a device is blocked, it would only be able to get an IP address from your router, but it won&apos;t be able to communicate with other devices, nor it would be able to connect to the Internet.<p><A name=enable_acc_control></A><p><b>To enable Access Control:</b><p>Select <b>Turn on Access Control</b> check box. Selecting this check box lets you block or allow computers or electronic devices from accessing your network. You have to select this check box before you can specify an Access Rule and use the Allow and Block buttons.  When this check box is cleared, all devices are allowed to connect, even if the device is in the blocked list.<p><A name=access_rule></A><p><b>Access Rule</b> radio buttons. Select the radio button for the Access Rule that you want for new devices attempting to connect to your network. The Access Rule does not affect previously blocked or allowed devices. It applies only to future devices joining your network after you apply these settings.<p>By default, “Allow all new devices to connect” is selected, so if you or your family buy a new device, it will be able to access your network without configuring its MAC address in this page.<p>NETGEAR recommends that you keep this option selected. If you change this to “Block all new devices from connecting”, then your new device won&apos;t be able to access your network until you specifically add its MAC address into the allowed list. For example, if a new computer has both wireless and Ethernet network connections, each connection has its own MAC address, you&apos;ll need to add specifically both MAC addresses to the allowed list.<p><b>Allow</b> and <b>Block</b> buttons. To allow or block access for a specific device, select its check box and then click the Allow or Block button to change its status.<p>Click <b>Apply</b> when you finish changing the settings.<p>Click <b>Cancel</b> to return to the previous settings.",
