"genie_271" : "VLAN ID",
"genie_272" : "<P><font size=4><B>VLAN/IPTV Help</B></font></P><p>Some Internet Service Providers (ISPs) require routers to send or receive virtual LAN packets for Internet connection. This requirement is common for fiber access.</p><p>Some IPTVs cannot work behind a wireless router&apos;s network address translation (NAT) firewall. You can create a network by bridging the IPTV port to Internet port without NAT.</p><p name=vlan id=vlan></p><p><b>VLAN Setup</b><p><ol><li> Select the Enable VLAN Tag check box.</li><li>Click  the Edit button.</li><li>Modify the VLAN ID andPriority settings, and the ports that belong to the group.</li>This information is available from your ISP.<br> <li>Click the Add button.</li></ol><p>The VLAN group is added.</p>Use an easy-to-remember name for the group.</p><p name=iptv id=iptv></p><p><b>IPTV Setup</b><p><ol><li>1. Clear the Enable VLAN Tag check box.</li><li>Click the Add button.</li></ol><p>The related ports are bridged.  Packets between bridged ports are not processed via NAT or firewall.</p></p></div>",
