"genie_933" : "Do not remind me again.",
"genie_934" : "<P><font size=4><B>Profile Settings Help</B></font></P><p>Profile can make quick router configurations in different environments. You can also manage , apply, or delete profiles here.</p><p><ol><li> Currently Applied Profile: </li> Display the profile now in operation. </p><p> <li> Always apply the selected profile: </li> <p>To apply the user defined profile, and disable system automatic detection mechanism. Once the checkbox is ticked, the router won&apos;t do auto-detection between profiles for users even after router reboots.</p><li> Profile List: </li> Show all existing profiles. <li> Delete Profile: </li> Delete the selected profile.</ol> </p>",
