"genie_1016" : "Remote access",
"genie_1017" : "<p>The ReadyCLOUD feature gives you remote access over the Internet to a USB storage device that is connected to your router&apos;s USB port.</p><p><b>How to Set Up ReadyCLOUD</b><br>Step 1: You need a ReadyCLOUD account. If you do not have one,<a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com/client/index.html#page=manage&quot;>click here</a> to create an account and select &quot;Create Account&quot;.<br> Step 2: Go to router GUI <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://routerlogin.net&quot;>http://routerlogin.net</a> ReadySHARE page, select ReadyCLOUD option, and enter your ReadyCLOUD user name and password to register your router with ReadyCLOUD.<br>Step 3: Log back into <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>http://readycloud.netgear.com</a> with your ReadyCLOUD account. The USB device that is connected to your router displays.<br><b>Note:</b>You can use a supplementary remote application to make a secure connection from your computer or mobile device to the router&apos;s USB device.<br>Log in to this remote application and you can access the USB device from anywhere. <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>Click here</a> to get the remote application.</p>",
