"genie_1117" : "5GHz Wireless Network Name (SSID): ",
"genie_1118" : "5GHz Wireless Network Password (Network Key): ",
"genie_1119" : "To prevent your WiFi devices from connection to the existing gateway, use the following name (SSID) and password  (network key) to connect all your WiFi devices to this router.",
"genie_1120" : "This router&apos;s wireless settings have been changed. Use the following wireless network name (SSID) and network key (password) to reconnect your device to the router, then click the <b>Finish</b> button below to complete the installation.",
"genie_1121" : "Finish",
"genie_1122" : "Note",
"genie_1123" : "Your new NETGEAR router is about to be set up to access point mode. You might experience a short network interruption because your new NETGEAR router and client must otain new IP address from your existing router. If you lost network connection, manually connect to your new NETGEAR router again by visiting <a href=&quot;http://www.routerlogin.net&quot; target=&quot;_blank&quot;><u>www.routerlogin.net</u></a>",
"genie_1124" : "Router wireless network name (SSID) and network key (password):",
"genie_1125" : "or",
"genie_1126" : "If you want to choose a mode yourself, you must select the Router Mode or Access Point Mode radio button.",
"genie_1127" : "You must select the Yes or No radio button.",
"genie_1128" : "VLAN ID: %1 / Priority: %2 pair already exists.",
"genie_1129" : "VLAN ID: %1 is used by other wireless interfaces. Same VLAN ID can only be used by one group with wireless interface.",
"genie_1130" : "At least one port MUST be in Internet group.",
"genie_1131" : "<P><font size=4><B>VLAN/IPTV Help</B></font></P><p>Some Internet Service Providers (ISPs) require routers to send or receive virtual LAN packets for Internet connection. This requirement is common for fiber access.</p><p>Some IPTVs cannot work behind a wireless router&apos;s network address translation (NAT) firewall. You can create a network by bridging the IPTV port to Internet port without NAT.</p><p name=vlan id=vlan></p><p><b>VLAN Setup</b><p><ol><li> Select the Enable VLAN Tag check box.</li><li>Click  the Edit button.</li><li>Modify the VLAN ID andPriority settings, and the ports that belong to the group.</li>This information is available from your ISP.<br> <li>Click the Add button.</li></ol><p>The VLAN group is added.</p><p>Use an easy-to-remember name for the group.</p><p name=iptv id=iptv></p><b>IPTV Setup</b><p><ol><li>Clear the Enable VLAN Tag check box.</li><li>Click the Add button.</li></ol><p>The related ports are bridged.  Packets between bridged ports are not processed via NAT or firewall.</p></p>",
