"D-genie_79" : "The wizard can export the wireless settings to an external USB drive. You can plug it into a USB port on another Windows PC.Then, run the program <b>genieWirelessConfig.exe</b> on the USB drive to update that PC&apos;s wireless settings so it can connect to the wireless network.",
