"D-genie_115" : "Support",
"D-genie_116" : "Frequently asked questions for your NETGEAR product are answered here.",
"D-genie_117" : "How can a new computer or wireless device connect to my wireless network",
"D-genie_118" : "To join the network, you can select it and enter its password, or if your computer supports Wi-Fi Protected Setup (WPS), you can use a WPS push-button or PIN to join the network.<br><br><B>Joining a network without using WPS: </B>How you do this depends on what kind of computer you have. For example, on a Windows PC, you can open Wireless Network Connection, select the network, and enter the network password. If you are using a NETGEAR wireless adapter, you can use its Smart Wizard to connect. <br><br><B>Using WPS to join a network:</B>  Press the WPS button on the router, then within 2 minutes click the WPS button on your computer or wireless device. The computer or wireless device joins the network. <br><br>If you changed the wireless network name and network password, and you don’t remember what they are, you can log in to the router from a computer already on the network to view these settings.  The user name for the router is <b>admin</b>. Its default password is <b>password</b>.  <br><br>If you have a preset router, it came with a unique wireless network name and network password. Both of these are on the router label. <br><br>To log in to the router, go to <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a> log in select Wireless Settings, and get the wireless network name (SSID) and security information.",
"D-genie_119" : "What to do first when there is no connection to the router or the Internet",
"D-genie_120" : "Try this power cycling sequence first to solve a network connection issue:<br><br>1.Turn off and unplug the power of the modem<br>2.Turn off the router<br>   3.Plug in the power of the modem and turn it on. Wait for 2 minutes<br>4.Turn on the router and wait for 1 minute",
"D-genie_121" : "I can connect to the router, but not to the Internet",
"D-genie_122" : "If you can connect to the router but not to the Internet, log in to the router and make sure the Internet Service Provider (ISP) settings are correct. These settings are located in the Basic Settings page on <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a>. The correct settings depend on your broadband service. Typically for DSL, you enter the DSL username (like xxx@att.net) and the DSL password.<br><br>If you are unsure which settings to use, contact your ISP.<br><br>If you have Internet through cable service, make sure your cable modem is powered off and then on during router set-up. If the router still does not get an Internet connection from the modem, it could be because the modem remembers the previous device&apos;s MAC address (for instance, the MAC address from the computer that you used to access the Internet before you got a router). You can enter that device&apos;s MAC in the Basic Settings page on <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a>.",
"D-genie_123" : "What is the password to log in to my router?",
"D-genie_124" : "The router user name is <B>admin</B>.<br><br>The default password is <B>password</B>.<br><br>Try the default password before restoring factory settings.<br><br>If your NETGEAR router supports <b>Password Recovery</b>, enables it when you change router password. <br><br>If you restore factory settings all your router’s set up information is lost and you will need to set it up all over again! For example,  the router will not remember  your Internet connection settings or any other custom settings that you specified<br><br>So, have your ISP information ready before restoring factory settings.",
"D-genie_125" : "What kind of wireless security should I use for my network?",
"D-genie_126" : "To secure your wireless network, NETGEAR recommends WPA2 or WPA wireless security (WEP is an old standard and is not recommended). Wireless security helps protect your network from hackers and unauthorized users.<br><br>If you have a preset router, it has a unique wireless network name and is also set up with WPA/WPA2 wireless security and a unique password.  Others who buy the same model of router will have different wireless network names and different passwords for their networks. <br><br>For NETGEAR routers, you can set up WPA2 or WPA with the NETGEAR genie or Smart Wizard, or you can log into your router at <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a> and go to Wireless Settings page. After you set up wireless security on the router, anyone who tries to connect wirelessly must enter the network passphrase or key that you set up. Otherwise they will not be able to connect.",
"D-genie_127" : "Troubleshooting Wireless Networks",
"D-genie_128" : "Each wireless device on the wireless network must have the same settings:<br><br><B>SSID</B>: The wireless network name is case-sensitive. (Netgear is different from NETGEAR). If you have a preset router, it has a unique wireless network name, which is on its label. The default SSID for other NETGEAR wireless routers is NETGEAR.<br><br><B>Channel</B>: The wireless channels are 1 to 11 in North America (1 to 13 in other countries).<br><br><B>Mode</B>: The wireless mode should be set to infrastructure mode for clients (computers) to connect to a wireless router.<br><br><B>Encryption</B>: You have these options for encryption:<br><B>.</B>No security<br><B>.</B>Use WEP<br><B>.</B>Use WPA-PSK<br><B>.</B>Use WPA2-PSK<br><br><B>Wireless radio</B>: This should be ON (the router&apos;s wireless LED should be lit.)<br><br><B>Access Control List (ACL)</B>: If you enable an ACL on your router, make sure the MAC address of each wireless adapter is included in that list.",
"D-genie_129" : "One PC is not connected to the Internet, but other PCs are",
"D-genie_130" : "Make sure this PC is set to Obtain an IP address automatically and Obtain DNS server address automatically for its IP address. You can right-click the network connection and select <B>Properties</B> then <B>TCP/IP Properties</B> to check or change the settings.<br><br>You should be able to ping www.routerlogin.net after setting it to automatic IP address.<br><br>If you change these settings for a PC, you might have to reboot it to enable it to access the network.",
"D-genie_131" : "If you would like to check the quality of your Internet Connection these tools may be of assistance.",
"D-genie_132" : "Trace Route",
"D-genie_133" : "DNS Lookup",
"D-genie_134" : "Computer Profile",
"D-genie_135" : "Use <B>PING</B> to test whether your computer can reach a particular host or website.",
"D-genie_136" : "Type the name or IP address of the host and click the button.",
"D-genie_137" : "Use <B>TRACE ROUTE</B> to identify the route taken by data packets from your computer to the host. Trace route helps the trained eye locate routing problems or firewalls that may be blocking your computer&apos;s access to the host. Type the name or IP address of the host and click the button.",
"D-genie_138" : "Host",
"D-genie_139" : "Use <B>DNS LOOKUP</B> to find the IP address of a hostname. The host could be any network-attached device with a name, typically a website. Type the name of the host and click the button.",
"D-genie_140" : "Alternatively, to find the hostname of an IP address, click the Reverse Lookup field. Type the IP address and click the arrow. Not all IP address have a hostname.",
