"D-genie_167" : "Disclaimer",
"D-genie_168" : "NETGEAR genie provides two speed tests. One measures how fast your PC can download website content, and the other third-party site measures your ISP broadband speed. With the first test, the results can vary based on the network conditions at the time tests are performed.  In addition, the results of the download speed test can vary based on the responsiveness of the website. Both situations are outside the control of the speed tests, so please keep in mind that the test results are estimates to be used for informational purposes only.",
