"D-genie_309" : "”I bought a NETGEAR 11n wireless router. Why can&apos;t I find WEP wireless security support in the router configuration GUI?",
"D-genie_310" : "WEP is supported. However, WiFi Alliance mandates that a wireless router must not run WEP security mode when its wireless speed is set to 11n mode. To see the WEP option, you need to set the router’s mode to “Up to 54Mbps” (legacy 802.11a/b/g speed); then the WEP option will be available. <br>WEP is less secure than WPA, and is also slower, so NETGEAR does not recommend WEP mode. ",
