"D-genie_331" : "The wireless radio might be off. Turn it on and then click Try again.",
"D-genie_332" : "NETGEAR genie provides two methods for testing speed. One method measures how fast your PC can download website content, and the other method provides a link to an unaffiliated 3rd-party site, www.speedtest.net, that measures your ISP broadband speed.  With the first test, the results can vary based on the network conditions at the time tests are performed.  In addition, the results of this first test can vary based on the responsiveness of the website from which you are downloading content. Both situations are outside the control of the first speed test, so please keep in mind that the test results are estimates and are to be used for informational purposes only.  Please refer to www.speedtest.net for any discussions that site may have about factors affecting its measurements of ISP broadband speeds.",
