"D-genie_356" : "Print Sharing for Windows PCs and Mac Computers with a USB Printer",
"D-genie_357" : "Step 1: Connect the USB printer to the router’s USB port with a USB printer cable.",
"D-genie_358" : "Step 2: Install the USB printer driver software on each computer that will share the printer.",
"D-genie_359" : "If you do not have the driver, contact the company that made the printer to locate and download the latest printer driver software.",
"D-genie_360" : "Step 3: On each computer that will share the printer, download the NETGEAR USB Control Center utility from <a href=&apos;http://www.netgear.com/readyshare&apos;>http://www.netgear.com/readyshare</a>. ",
"D-genie_361" : "Follow the instructions in the utility to connect to the printer from your computer and print.",
"D-genie_362" : "ReadySHARE Printing",
"D-genie_363" : "My router stopped working and the Power LED blinks slowly, what should I do?",
"D-genie_364" : "If the router’s power LED blinks slowly, it means the router’s firmware is corrupted. You can use the following procedure to recover the router. If this procedure does not work and your router is still under warranty, please contact NETGEAR Technical Support.<br><br>Step 1: Using another Internet connection (such as at work or in a Wi-Fi hotspot), download the latest firmware for your router from <a href = &apos;http://www.netgear.com&apos;>http://www.netgear.com</a>.<br><br>Step 2: Use an Ethernet cable to connect your computer to one of the 4 LAN ports on the router. Configure the computer with a static IP address of 192.168.1.2 and subnet mask 255.255.255.0.<br><br><B>.</B>&nbsp;&nbsp;<b>Windows</b>: Select <b>Control Panel > Network Connections</b>. Right click <b>Local Area Connection</b> and select <b>Properties</b>, then highlight <b>Internet Protocol (TCP/IPv4)</b> and click <b>Properties</b>. In the IP configuration page, select the <b>Use the following IP address</b> check box, enter <b>192.168.1.2</b> as the IP address and <b>255.255.255.0</b> as the subnet mask, and click <b>OK</b>.<br><B>.</B>&nbsp;&nbsp;<b>Linux or Mac</b>: Use Linux or Mac instruction to set the computer with this static IP.<br><br>Step 3: If using a Windows PC, open a command window, for Linux or Mac, use a TFTP client.<br><br><B>.</B>&nbsp;&nbsp;<b>Windows 7</b>: Click the <b>Start</b> button. In the Search box, type <b>cmd</b> and press <b>Enter</b>.<br><B>.</B>&nbsp;&nbsp;<b>Windows XP</b>: Select <b>Start > Run</b>, and type <b>cmd</b> and press <b>Enter</b>.<br><br>Use the cd command to go to the directory (folder) with the firmware you downloaded in Step 1. Run the command <b>tftp -i 192.168.1.1 put firmware_filename</b>.<br><br><B>.</B>&nbsp;&nbsp;<b>Linux or Mac</b>: Download and run any TFTP client available for your operating system.<br><br>Step 4: Wait for a few minutes for the router to save the new firmware and reboot. The power LED turns green after a successful recovery.<br><br>Step 5: Set the computer’s IP address back to dynamic IP using a procedure similar to Step 2 by selecting the <b>Obtain an IP address automatically</b> check box.",
