"D-genie_564" : "<p><font size=4><b>Device Name Help</b></font></p><p name=mode></p><p><b>Device Name:</b> The device name identifies this router. Many router features provide this name to client devices connected for identification and display. If you change the device name, all the following fields listed below will be updated. You will also be given the option to change your ReadySHARE storage access path to the new device name.</p><p><b>Router GUI Field Names That Display the Device Name</b><br>The following lists the field names in the GUI that display the device name and the pages they are located on:<ul><li>Internet Setup page: Account Name</li><li>LAN Setup page: Device Name</li><li>Media Server page: Media Server Name</li><li>Router/AP/Extender Mode > AP Mode page: Device Name</li><li>Router/AP/Extender Mode > Extender Mode page: Device Name</li></ul></p><p><b>Clients That Display the Device Name</b><br>The device name displays in the following clients:<ul><li>iTunes Server</li><li>Time Machine Server</li><li>ReadySHARE Printer or Bonjour Print Server</li><li>LLTD</li><li>UPNP</li><li>WPS Device</li></ul></p>",
