"M-genie_104" : "You are not connected to a NETGEAR router, or the router is not allowing this device to connect. This function is not available.",
"M-genie_105" : "NETGEAR genie is the easy App to manage and monitor your home NETGEAR routers. It provides easy access to cool features on your router: Wireless Settings, Network Map, Live Parental Controls, Guest Access, Traffic Metering, My Media, and more.",
"M-genie_106" : "IMPORTANT NOTES",
"M-genie_107" : "Android version supported: Android 2.2 or higher",
"M-genie_108" : "General Information: To use the NETGEAR genie App, the Android device must be connected to one of the supported NETGEAR routers listed as below:",
"M-genie_109" : "My Media:",
"M-genie_110" : "My Media uses the default media player on an Android device to play media files if the Android device is being used as a player. Different Android versions support different ranges of media formats. The following list is based on Android version 4.0 supported media formats:",
"M-genie_111" : "Supported audio formats: AAC, HE-AAC, AMR-NB, AMR-WB, FLAC, MP3, MIDI, Vorbis, and PCM/WAVE.",
"M-genie_112" : "Supported video formats: H.263, H.264 AVC, MPEG-4 SP, and VP8.",
"M-genie_113" : "Supported photo formats: JPEG, GIF, PNG, BMP, and WEBP.",
"M-genie_114" : "For more information on supported media formats, see the Technical Specifications for your Android device.",
"M-genie_115" : "Please note when using My Media:",
"M-genie_116" : "Each supported media format has limitations in media encoding parameters, such as bitrate, frame rate, and resolution. When My Media is unable to play media files with the supported formats, it may be because the files have higher bitrates or frame rates that exceed the rate it can support.",
"M-genie_117" : "The devices listed in Player view will be your own device, and other devices available in the network, such as PCs, TVs, stereos, or smartphones.",
"M-genie_118" : "The Android NETGEAR genie needs to be running in the My Media function to show up as a player or source.",
"M-genie_119" : "Some media files can be played in some players, but can&apos;t be played in other players. Different player supports different kinds of media file formats. For more information, see the Technical Specifications for the player.",
"M-genie_120" : "If My Media can&apos;t find any source or any player, it may be because your device is disconnected from the NETGEAR router. Make sure it is connected to the NETGEAR router by checking the Wi-Fi connection in Settings.",
"M-genie_121" : "After any change in the network, including Wi-Fi setting, source folder change, and list of player change, you will need to restart the media service and refresh the source folder in the Options view.",
"M-genie_122" : "When playing media files on your own Android device, tapping the screen brings up play progress and player control.",
"M-genie_123" : "It sometimes takes a long time to access and play a media file. This may be caused by a slow network, large file size, or heavy load in the player or source device.",
"M-genie_124" : "iOS version supported: iOS 4.2.1 or higher",
"M-genie_125" : "General Information: To use the NETGEAR genie App, the iOS device must be connected to one of the supported NETGEAR routers listed as below:",
"M-genie_126" : "My Media uses the default media player on an iOS device to play media files if the iOS device is being used as a player. Supported media formats are:",
"M-genie_127" : "Supported audio formats: AAC, HE-AAC, MP3, Apple Lossless, AIFF and WAV.",
"M-genie_128" : "Supported video formats: H.264, MPEG-4, and M-JPEG.",
"M-genie_129" : "Supported photo formats: JPG, TIFF, GIF, PNG, and BMP.",
"M-genie_130" : "For more information on supported media formats, see the Technical Specifications for your iOS device.",
"M-genie_131" : "The devices listed in Player view will be your own device, and other devices available in the network, such as PCs, TVs, stereos, or smartphones. If you select another device to play media files in Player view, you may encounter some of the following behaviors, which are not the bugs for My Media:",
"M-genie_132" : "The iOS NETGEAR genie needs to be running in the My Media function to show up as a player or source.",
"M-genie_133" : "genie can show photos and videos in Source view if you grant genie permission to access the location service. genie can&apos;t play music from the iOS device in this version.",
"M-genie_134" : "Use the File Sharing feature to transfer media files from your computer to genie. After genie is installed and the iOS device is connected to iTunes, go to the Apps tab. The File Sharing section is at the bottom of the page. Select genie in Apps, then drag and drop the media files to the genie Document list box.",
