"Analytics_001" : "Enable collection of <a href=&quot;#&quot; onclick=&quot;window.open(&apos;ra_data_detail.htm&apos;,&apos;name&apos;,&apos;width=600,height=400,scrollbars=1,resizable=1&apos;,&apos;blank&apos;)&quot; style=&quot;color: rgb(000,000,255);text-decoration:underline&quot;> <font size=&quot;&quot;>router analytics data</font></a> that will help NETGEAR improve our services and products.",
"Analytics_002" : "Enable router to automatically update to future firmware. This keeps your router up to date with the latest features and security fixes.",
"Analytics_003" : "To complete the installation process, you must agree to the Terms of Services.<br>If you do not accept these Terms of Services, you must return Your NETGEAR device.",
"Analytics_004" : "I Agree",
