"Analytics_006" : "Privacy Policy",
"Analytics_007" : "To complete the installation process, you must select one of the following options.",
"Analytics_008" : "Router Auto Firmware Update",
"Analytics_009" : "Router Analytics Data Collection",
"Analytics_010" : "Terms of Services",
"Analytics_011" : "Select one of the following options:",
"Analytics_012" : "Please make your selection for both features above to continue.",
"Analytics_013" : "Technical data about the functioning and use of our routers and their WiFi network can help us to more quickly isolate and debug general technical issues, improve router features and functionality, and  improve the performance and usability of our routers.   Such data may include information regarding the router’s running status, number of devices connected to the router, types of connections, LAN/WAN status, WiFi bands and channels, IP address, MAC address, serial number, and similar technical data about the functioning and use of the router and its WiFi network.",
"Analytics_014" : "By clicking &quot;I Agree&quot; you agree that upon installation, your router may transmit the data described above to NETGEAR, which may use the information to provide and improve its products and services. For additional information about the protection of your transmitted data and how it may be used see the NETGEAR Privacy Policy.  NETGEAR does not use this information to market products or services to you or to track or collect the websites you visit or collect the content of any traffic on your network.  You may withdraw this consent at any time by going to the routerlogin.net Advanced>Administration>Router Update.",
"Analytics_015" : "In addition, with or without the prior consent,  some basic information, such as the router’s firmware version number and model number, may still be collected and used to monitor deployment of  NETGEAR products and firmware versions.   We will not link such information to your router’s serial number or MAC address or your name or other personal information.",
"Analytics_016" : "2017.03.13 Version 1.0",
"Analytics_017" : "<b>NETGEAR Terms of Services</b>",
"Analytics_018" : "Please read these NETGEAR Firmware Auto Update Terms (&quot;<b>Firmware Terms</b>&quot;) carefully. Your use of the NETGEAR device and its included Services (as defined below) indicates that You have read, accepted and agreed to these Firmware Terms and constitutes Your consent to this Agreement.",
"Analytics_019" : "These Firmware Terms are between you (&quot;<b>You</b>&quot; or &quot;<b>User</b>&quot;) and NETGEAR, Inc. concerning your use of (including any access to) services provided by NETGEAR, Inc., its subsidiaries and affiliates (collectively, &quot;<b>NETGEAR</b>&quot;) in connection with the NETGEAR device you purchased, and the software (including software included in Your device at the time of purchase), firmware, documentation, and other information and materials provided on or in connection with such Services (individually and collectively, the &quot;<b>Services</b>&quot;).",
"Analytics_020" : "<b>1.    ACCEPTANCE OF THE FIRMWARE TERMS</b>",
"Analytics_021" : "1.1  By using the Services, You affirm that You are of legal age to enter into these Firmware Terms. You may not use the Services if You are a: (a) person who is not of legal age or otherwise not entitled to form a binding contract with NETGEAR, or (b) person who is barred from receiving the Services under the laws of any country including the country in which You are a resident or from which You are using the Services.",
"Analytics_022" : "1.2  If You are an individual accessing or using the Services on behalf of, or for the benefit of, any corporation, partnership or other entity with which You are associated (an &quot;<b>Organization</b>&quot;), then You are agreeing to these Firmware Terms on behalf of Yourself and such Organization, and You represent and warrant that You have the legal authority to bind such Organization to these Firmware Terms. References to &quot;<b>You</b>&quot; and &quot;<b>Your</b>&quot; in these Firmware Terms will refer to both the individual using the Services and to any such Organization.",
"Analytics_023" : "<b>2.    SOFTWARE AND SOFTWARE UPDATES TO THE SERVICES AND DEVICE</b>",
"Analytics_024" : "2.1 Software Updates.  Your NETGEAR device may: (i) communicate with NETGEAR servers from time to time to automatically check for available updates, such as bug fixes, critical system updates, patches, enhanced functions, upgrades, missing plug-ins and new versions (collectively, &quot;<b>Software Updates</b>&quot;) and (ii) install the Software Updates. Such Software Updates may be in various forms and are provided for the purposes of improving the performance, security, or reliability of the Services or the NETGEAR device.  By using the Services, You agree to receive all Software Updates that NETGEAR sends to the software included in the Services and Your NETGEAR device.  If You disable this automatic upgrade feature of the Services then certain functionality of the Services and/or NETGEAR device may be adversely impacted. Even if You disable the automatic upgrade feature of Your Services, NETGEAR may still implement updates for certain applications running on NETGEAR&apos;s back-end services.",
"Analytics_025" : "2.2 Open Source Software. Certain components of the software for the NETGEAR device and /or Services and Software Updates are subject to the GNU General Public License (&quot;<b>GPL</b>&quot;) or other so-called open source licenses (&quot;<b>Open Source Software</b>&quot;). Open Source Software may not be subject to certain restrictions. You are free to use, modify and distribute Open Source Software that is subject to the GPL or other free or open source software licensing model in the Software&apos;s Documentation, so long as You comply with the terms of the GPL (available at www.gnu.org/copyleft/gpl.html) or such other free or open source software licensing terms. For clarification, these Firmware Terms do not limit Your rights under, or grant You rights that supersede, the license terms of any applicable Open Source Software.",
"Analytics_026" : "You may contact NETGEAR at the following addresses (as applicable):",
"Analytics_027" : "NETGEAR, Inc.<br>350 East Plumeria Drive<br>San Jose, CA 95134<br>Corporate Office Phone: 408-907-8000<br>Corporate Office Fax: 408-907-8097<br><br>OR<br><br>NETGEAR International Limited<br>First Floor Building 3 University Technology Centre Curraheen Road<br>Cork, Ireland<br>Corporate Office Phone: 353 21 2333 200<br>Corporate Office Fax: 353 21 2333 299<br><br>© 2017 NETGEAR, Inc.  All Rights Reserved.",
"Analytics_028" : "2017.09.30 Version 1.1",
