"PCVP_042" : "<body bgcolor=#0099cc ><P><font size=4><B> Port Forwarding / Port Triggering Help </B></font></P><p>Port triggering is an advanced feature that you can use for gaming and other Internet applications. Port forwarding can typically be used to enable similar functionality, but it is static and has some limitations. </p><p>Port triggering opens an incoming port temporarily and does not require the server on the Internet to track your IP address if it is changed by DHCP, for example. </p><p>Port triggering monitors outbound traffic. When the router detects traffic on the specified outbound port, it remembers the IP address of the computer that sent the data and triggers the incoming port. Incoming traffic on the triggered port is then forwarded to the triggering computer.</p><p><a name=select></a>Using the Port Forwarding / Port Triggering screen, you can make local computers or servers available to the Internet for different services (for example, FTP or HTTP), to play Internet games (like Quake III), or to use Internet applications (like CU-SeeMe).</p><p>Port forwarding is designed for FTP, Web server, or other server-based services. Once port forwarding is set up, requests from the Internet are forwarded to the proper server. </p><p>Port triggering allows requests from the Internet only after a designated port is triggered. Port triggering applies to chat and Internet games.</p><hr><p><a name=pt_enable></a><b>Port Triggering</b></p><p>Note: If <b>Disable Port Triggering box</b> is checked, <b>all</b> port triggering function will be disabled but the configuration information will remain in the router.</p><p><a name=pt_timeout></a><b>Port Triggering Timeout</b></p><p>Enter a value up to 9999 minutes. The Port Triggering Timeout value controls the inactivity timer for the designated inbound port(s). The inbound port(s) will be closed when the inactivity timer expires.</p><p><b> For Internet Games or Applications </b></p><p>Before starting, you&apos;ll need to know which service, application or game you&apos;ll be configuring. Also, you&apos;ll need to have the outbound port ( triggering port )  address for this game or application.</p><p>To setup a computer to play Internet games or use Internet applications: <ol> <li> Click <b>Add Service</b> button. </li> <li> Enter a service name in the <b>Service Name</b> box.  </li> <li> Under <b>Service User</b>,  select <b>Any</b> (default) will allow this service to be used by everyone in your network. Otherwise, select <b>Single address</b> and enter the PC&apos;s IP address to restrict the service to a particular PC. </li> <li> Select <b>Service Type</b>. </li> <li> Enter the outbound port number in <b>Triggering Port</b> box. </li> <li> Enter the inbound connection port information such as <b>Connection Type</b>, <b>Starting Port</b> and <b>Ending Port</b> boxes. These information can be obtained from the game or applications manual or support website.  </li> <li> Click <b>Apply</b> button.  </li></ol><p>To modify a service entry:<ol> <li>Select the entry&apos;s radio button of the table. </li> <li> Click <b>Edit Service</b>. </li> <li> Modify the service.</li> <li>  Click <b> Apply</b> button.</li></ol><p>To delete a service entry:<ol> <li>  Select the entry&apos;s radio button of the table. </li> <li>  Click <b> Delete Service</b> button. </li></ol></body>",
