"PCVP_105": "<p><font size=4><b>Bridge Mode Help</b></font></p><p><b>Bridge mode:</b> Set this router in bridge mode and use its 802.11ac WiFi connection to connect it to your existing router or gateway. This mode allows you to take advantage of gigabit WiFi speeds on current devices and avoid the need for separate WiFi adapters for each device. Some router functions are not available in bridge mode.</p><p><b>Router Functions</b></p><p>The following router functions are not available if you choose access point or bridge mode:</p><ul><li>Guest network</li><li>Parental controls</li><li>QoS</li><li>Access control</li><li>Traffic meter</li><li>Block sites</li><li>Block sites</li><li>Block services</li><li>Static route</li></ul><p><b>Get IP Address Dynamically</b></p><p>Clear the <b>Get IP Address Dynamically</b> check box if you want to manually enter the IP address, subnet mask, and gateway IP addresses.</p><p><b>Get DNS Server Address Dynamically</b></p><p>Clear the <b>Get DNS Server Address Dynamically</b> check box if you want to manually enter the DNS server IP address.</p>",
"PCVP_106": "<font size=4><b>NTP</b></font></p><P>To make sure that the time used by your NETGEAR product is accurate, use the Network Time Protocol (NTP) to synchronize your NETGEAR product with the Coordinated Universal Time (UTC). </P><P><B>Current Time</B></P><P>After you set up your time zone, the current time is adjusted accordingly. </P><P><B>Use default NETGEAR NTP server</B></P><P>NETGEAR deployed NTP servers worldwide. After you set your time zone, NETGEAR chooses an NTP server nearby to synchronize the time of your NETGEAR product. </P><P><B>Set your preferred NTP server</B></P><P>To change the NTP server to your preferred NTP server: </P><ol><li>Select the <B>Set your preferred NTP server</B> radio button. </li><li>Enter your preferred NTP server in the <B>NTP server</B> field. </li></ol><P>Note: The NTP server that you enter must be in an IP address or domain name format. </P><a name=timezone></a><p><b>Time Zone</b><p>Select the local time zone. This is required in order for the schedule to work correctly.</p><p>If you live in a region that observes daylight saving time, select the <b>Automatically Adjust for Daylight Savings Time</b> check box.",
