"RAX5_QOS_4" : "<p><font size=4><b>Speed Test Help</b></font></p><p>Speed Test improves online gaming and online streaming quality by prioritizing Internet bandwidth usage. When the router detects online gaming and online streaming traffic, the router tries to limit background traffic such as BitTorrent or FTP downloads to improve gaming and streaming. </p><a name=enable_qos></a><p><b>Enable Speed Test:</b> Enable or disable the Speed Test. </p><a name=ookla_detect></a><p><b>Internet Bandwidth - Let Speedtest detect my Internet bandwidth (recommended):</b> Accurate Internet bandwidth is required for Speed Test to work properly. The router automatically runs Speedtest the  first time you enable Speed Test. Click the <b>Speedtest</b> button to recheck your bandwidth. Avoid any Internet activity while Speedtest is running. </p><a name=manual_define></a><p><b>Internet Bandwidth - I want to define my internet Bandwidth:</b> If you know your Internet bandwidth, you can enter it manually here. The maximum value is 1000.00. </p>",
